INSERT INTO `SiteTree` (`ID`, `ClassName`, `Created`, `LastEdited`, `URLSegment`, `Title`, `MenuTitle`, `Content`, `MetaTitle`, `MetaDescription`, `MetaKeywords`, `ShowInMenus`, `ShowInSearch`, `HomepageForDomain`, `ProvideComments`, `Sort`, `LegacyURL`, `HasBrokenFile`, `HasBrokenLink`, `Status`, `ReportClass`, `_obsolete_Viewers`, `_obsolete_Editors`, `_obsolete_ViewersGroup`, `_obsolete_EditorsGroup`, `ParentID`, `Version`, `Priority`, `ExtraMeta`, `ToDo`, `CanViewType`, `CanEditType`, `Locale`, `SubsiteID`, `MasterPageID`, `RelationFieldsTestPageID`)
VALUES
	(102,'Page','2007-10-01 12:47:24','2012-08-29 10:03:02','about','About',NULL,'<h2 style=\"text-align: left;\">SilverStripe is a friendly and flexible open source CMS.</h2>\n<p>It\'s designed to be super easy to update content, and to let designers and developers build rich, amazing, websites.</p>\n<p>It\'s been downloaded about 500,000 times and powers websites for government agencies, corporations, non profits, and a large number of much smaller websites.</p>\n<p>It\'s created by SilverStripe Ltd, pictured below, together with a vibrant open source community.</p>\n<p><em>(Try resizing this image in the <a href=\"http://demo.silverstripe.com/admin/\">CMS</a>! When you save the page, it is resampled.)</em></p>\n<p style=\"text-align: left;\"><em><img class=\"left\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage500131-New-Team-Photo.jpg\" alt=\"New-Team-Photo.jpg\" width=\"500\" height=\"131\"/><br/></em></p>\n<p style=\"text-align: left;\"> </p>\n<p style=\"text-align: left;\">To find out more - and to download the SilverStripe CMS - please visit <a href=\"http://www.silverstripe.org\">silverstripe.org</a>.</p>',NULL,NULL,NULL,1,1,NULL,0,2,NULL,1,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,78,1,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(202,'Page','2007-10-01 12:47:24','2012-08-29 10:03:03','contact-us','Contact Us',NULL,'<p style=\"text-align: left;\">You can fill this page with your own content or delete it and create your own pages.</p>\n<table style=\"text-align: left;\" summary=\"Listing of SilverStripe\'s contact information\" border=\"0\"><tbody><tr><td>Phone </td>\n<td>+123 456 7890</td>\n</tr><tr><td>Email</td>\n<td>support at website.com </td>\n</tr><tr><td>Postal Address</td>\n<td>123 Street Name<br/> Neighborhood<br/> City</td>\n</tr></tbody></table>',NULL,NULL,NULL,1,1,NULL,0,4,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,79,1,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(6674,'Page','2012-05-25 08:28:48','2012-08-29 10:03:03','responsive','Responsive',NULL,'<p>Reduce the width of your browser window to the length of this line.</p>\n<p>The menus and other elements of the page will change to be mobile friendly.</p>\n<p>Or, view this page on your favourite smartphone.</p>\n<p>That\'s called a responsive design, a technique made possible using HTML5. This behaviour is provided by the default SilverStripe 3 theme, named Simple.</p>\n<p><img class=\"left\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage378567-iPhoneSimple.PNG\" alt=\"iPhone screenshot of Simple\" width=\"378\" height=\"567\"/></p>','Responsive',NULL,NULL,1,1,NULL,0,5,NULL,1,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,6686,10,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(502,'ErrorPage','2007-10-01 12:47:25','2012-08-29 10:03:03','page-not-found','Page not found',NULL,'<p style=\"text-align: left;\">Sorry, it seems you were trying to access a page that doesn\'t exist.</p>\n<p style=\"text-align: left;\">Please check the spelling of the URL you were trying to access and try again.</p>',NULL,NULL,NULL,0,0,NULL,0,5,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,15,1,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(1302,'Page','2007-10-01 13:47:31','2012-08-29 10:03:02','the-site-tree','The site tree',NULL,'<h2 style=\"text-align: left;\">SilverStripe CMS lets you structure the website in a logical, organised way by \"nesting\" pages in a hierarchy.</h2>\n<p>As you alter the site tree shown below, menus and lists throughout the website are updated. Clicking on a page in the site tree lets you edit that page.</p>\n<p><img class=\"left\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage600359-screenshot-sitetree.png\" alt=\"screenshot sitetree\" height=\"359\" width=\"600\"/></p>',NULL,NULL,NULL,1,1,NULL,0,3,NULL,1,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,102,62,0.9,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(6676,'Page','2012-05-25 10:09:09','2013-10-01 12:29:53','beautiful-interface','Beautiful interface',NULL,'<p>The first thing you\'ll notice a entirely refreshed content management user interface. Developers will appreciate it is built on HTML5 and jQuery, but content authors will just love that they can do their work more quickly, using a beautiful user interface. </p>\n<p><img class=\"leftAlone\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage750552-Screen-Shot-2012-05-25-at-10.23.44-AM.png\" alt=\"Screen Shot of SS3 Interface\" width=\"750\" height=\"552\"/></p>','New Features',NULL,NULL,1,1,NULL,0,1,NULL,1,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,6672,13,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(6677,'Page','2012-05-25 10:11:31','2012-08-29 10:03:03','drop-images','Drop images',NULL,'<p>Uploading images is easier; just drag them into the insert image window from your desktop.</p>\n<p><img class=\"left\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage600424-Screen-Shot-2012-05-25-at-10.41.34-AM2.png\" alt=\"Drag drop image demo\" height=\"424\" width=\"600\"/></p>','Drop images',NULL,NULL,1,1,NULL,0,3,NULL,1,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,6686,6,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(86,'Page','2007-10-01 12:47:24','2013-10-01 12:29:53','home','Try the Silverstripe CMS Demo','Home','<div id=\"Thanks\">\n<p style=\"text-align: left;\">Welcome to the public demo of SilverStripe 3. Please browse around.</p>\n<p style=\"text-align: left;\"><a href=\"admin/\">Try out the content authoring interface</a> by logging in with \'admin\' and \'password\'.</p>\n<p>[embed width=600 height=337 class=leftAlone thumbnail=http://b.vimeocdn.com/ts/312/000/312000748_1280.jpg?r=76307]https://vimeo.com/44848958[/embed]</p>\n<p>You can also try the CMS interface in a different language with the following logins:</p>\n<ul><li>German (Username: \"german\", password: \"password\")</li>\n<li>French (Username: \"french\", password: \"password\")</li>\n<li>Spanish (Username: \"spanish\", password: \"password\")</li>\n<li>Chinese (Username: \"chinese\", password: \"password\")</li>\n<li>Te Reo/Māori (Username: \"tereo\", password: \"password\")</li>\n</ul><p>More languages are available in the <a href=\"http://admin/myprofile\">profile settings</a>.</p>\n</div>','Welcome to the SilverStripe Open Source CMS demo','this is my test of this website template...','silverstripe 3, demo, cms, html5, open source content management system, php',1,1,NULL,0,1,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',0,0,0,252,NULL,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(5902,'Page','2007-11-28 10:08:05','2012-08-29 10:03:03','ingo-schommer','Ingo Schommer',NULL,'<p/>','Ingo Schommer',NULL,NULL,1,1,NULL,0,4,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,5802,7,0.8,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(6002,'Page','2007-11-28 10:09:03','2012-08-29 10:03:03','sam-minnee','Sam Minnee',NULL,'<p/>','Sam Minnee',NULL,NULL,1,1,NULL,0,5,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,5802,5,0.8,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
