	(6670,'ErrorPage','2010-08-19 12:31:00','2012-08-29 10:03:03','server-error','Server error',NULL,'<p>Sorry, there was a problem with handling your request.</p>',NULL,NULL,NULL,0,0,NULL,0,6,NULL,0,0,'New page',NULL,'Anyone','LoggedInUsers',0,0,0,2,NULL,NULL,NULL,'Inherit','Inherit','en_US',0,0,0),
	(4302,'Page','2007-11-20 12:56:41','2012-08-29 10:03:02','drag-and-drop-sitemap','Drag & drop sitemap',NULL,'<h2 style=\"text-align: left;\">The pages and files that make up the site tree of a SilverStripe website can be reshuffled by dragging and dropping them around.</h2>\n<p style=\"text-align: left;\">This makes re-arranging your site a fun and fast activity<em>.</em></p>\n<p style=\"text-align: left;\"><em><img class=\"left\" title=\"\" src=\"assets/Uploads/screenshot-dragdropsitemap.png\" alt=\"screenshot dragdrop sitemap\" height=\"298\" width=\"256\"/></em></p>\n<p><em> </em></p>\n<p> </p>\n<p> </p>\n<p> </p>','Drag & drop',NULL,NULL,1,1,NULL,0,2,NULL,1,0,'Published',NULL,'Anyone','LoggedInUsers',0,0,102,36,NULL,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(6672,'Page','2012-05-24 17:32:21','2013-10-01 12:29:53','media-insertion','Media insertion',NULL,'<p>You can insert media from a variety of sites into your page, thanks to the magic of oEmbed! Just click the \"insert media\" button (it looks like a picture of a tree) and enter the URL of your video (youtube, vimeo), photo (flickr, or URL), or presentation (slideshare).</p>\n<p><img class=\"left\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage600327-media-inserter.png\" alt=\"media inserter demo\" height=\"327\" width=\"600\"/></p>\n<p>Example embedded of video:</p>\n<div class=\"captionImage center\" style=\"width: 600px;\">[embed width=600 height=337 class=center thumbnail=http://b.vimeocdn.com/ts/103/759/103759717_640.jpg?r]http://vimeo.com/16842606[/embed]\n<p class=\"caption\">You can also embed SlideShare presentations.</p>\n<p class=\"caption\">[embed width=425 height=355 class=left thumbnail=http://www.slideshare.net/silverstripe/silverstripe-participates-in-gsoc-2012?r]http://www.slideshare.net/silverstripe/silverstripe-participates-in-gsoc-2012[/embed]</p>\n</div>','Media insertion',NULL,NULL,1,1,NULL,0,1,NULL,1,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,6686,15,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(6679,'Page','2012-05-25 11:31:30','2013-10-01 12:29:53','easy-page-editing','Easy page editing',NULL,'<p>It\'s easy to locate a page to edit, and a rich-text editor makes content updating very easy. Adding pages, links, images, and videos can all be done from your web browser without technical or HTML knowledge.</p>\n<p>A site can have any number of page <em>types</em>, each with their own editable fields, templates, and behaviour. A developer can invent new types of fields and behaviour both in the CMS and for the public-facing website. This enables both the CMS and the website to be perfectly tailored to suit requirements.</p>\n<p>The notion of a Draft and Published site enables you to save and preview your changes before the public see it.</p>\n<p><img class=\"left\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage600421-screenshot-3-general.png\" alt=\"screenshot 3 general\" height=\"421\" width=\"600\"/></p>\n<p> </p>','Easy page editing',NULL,NULL,1,1,NULL,0,1,NULL,1,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,102,5,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(6678,'Page','2012-05-25 10:58:19','2012-08-29 10:03:03','styles','Styles',NULL,'<p>Pages of your website should be typographically consistent. Content authors can choose from a list of styles by a designer (in a CSS file). Removing the option for content authors to chose font colours and faces produces better professionalism of the website, and makes the editing interface simpler. It also means you can later change the visual apperance or theme of your website without altering your written content.</p>\n<h1>Heading One</h1>\n<h2>Heading Two</h2>\n<h3>Heading Three</h3>\n<p>Normal text, <a href=\"[sitetree_link,id=86]\">hyperlinks</a>, <strong>bold</strong>, and <em>italics</em>.</p>\n<blockquote>\n<p>Quote. Quote. Quote.</p>\n</blockquote>\n<p>You can insert symbols © and SilverStripe supports characters from languages across the globe. ÄÃ¨Ã­Ã¸Ã¼.</p>\n<ul><li>Bullet One</li>\n<li>Bullet Two</li>\n<li>Bullet Three</li>\n</ul>','Styles',NULL,NULL,1,1,NULL,0,4,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,102,5,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(6680,'Page','2012-05-25 11:46:39','2012-08-29 10:03:03','under-the-hood','Under the hood',NULL,'<p>Behind the clean CMS and website presentation sits <a href=\"http://www.silverstripe.org/framework-introduction/\">SilverStripe Framework</a>. Website developers use the framework to write code to create templates, logic, and tailor how the CMS works. Developers get the power and flexibility of (object oriented PHP 5.3+) code, designers get the freedom of HTML5 and CSS, and content authors get the simplicity of a tailored CMS.</p>\n<p><img class=\"leftAlone\" title=\"\" src=\"assets/Uploads/silverstripe-php-code-sample.png\" alt=\"silverstripe php code sample\" width=\"298\" height=\"162\"/></p>',NULL,NULL,NULL,1,1,NULL,0,6,NULL,1,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,102,5,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(6681,'Page','2012-05-25 13:52:37','2012-08-29 10:03:03','security-and-audit-trail','Security & Audit Trail',NULL,'<p>Every save made to a page contributes to an audit trail. You can compare old versions with each other and roll back to them in the History Tab.</p>\n<p>A powerful security system allows viewing and editing of pages to be restricted to various users. Users and groups can be created, and this can all provide the basis for secure login areas or more elaborate publishing workflow.</p>\n<p><img class=\"leftAlone\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage600421-silverstripe-security-page.png\" alt=\"silverstripe security page\" height=\"421\" width=\"600\"/></p>','Security & Audit Trail',NULL,NULL,1,1,NULL,0,5,NULL,1,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,102,6,NULL,NULL,NULL,'Anyone','OnlyTheseUsers',NULL,0,0,0),
	(6682,'Page','2012-06-28 13:00:19','2012-08-29 10:03:02','listview','Listview',NULL,'<p>ListView makes finding and updating pages on very large sites considerably easier. In the CMS, while browsing the familiar site tree, click the  Treeview icon. Now you can work with the site tree using filters and paginated lists.</p>\n<p><img class=\"left\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage699514-listview-509rows-screenshot.png\" alt=\"listview 509rows screenshot\" width=\"699\" height=\"514\"/></p>','Treeview',NULL,NULL,1,1,NULL,0,2,NULL,1,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,6686,11,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
