INSERT INTO `SiteTree_Live` (`ID`, `ClassName`, `Created`, `LastEdited`, `URLSegment`, `Title`, `MenuTitle`, `Content`, `MetaTitle`, `MetaDescription`, `MetaKeywords`, `ShowInMenus`, `ShowInSearch`, `HomepageForDomain`, `ProvideComments`, `Sort`, `LegacyURL`, `HasBrokenFile`, `HasBrokenLink`, `Status`, `ReportClass`, `_obsolete_Viewers`, `_obsolete_Editors`, `_obsolete_ViewersGroup`, `_obsolete_EditorsGroup`, `ParentID`, `Version`, `Priority`, `ExtraMeta`, `ToDo`, `CanViewType`, `CanEditType`, `Locale`, `SubsiteID`, `MasterPageID`, `RelationFieldsTestPageID`)
VALUES
	(86,'Page','2007-10-01 12:47:24','2012-08-29 10:17:37','home','Try the Silverstripe CMS Demo','Home','<div id=\"Thanks\">\n<p style=\"text-align: left;\">Welcome to the public demo of SilverStripe 3. Please browse around.</p>\n<p style=\"text-align: left;\"><a href=\"admin/\">Try out the content authoring interface</a> by logging in with \'admin\' and \'password\'.</p>\n<p>[embed width=600 height=337 class=leftAlone thumbnail=http://b.vimeocdn.com/ts/312/000/312000748_1280.jpg?r=76307]https://vimeo.com/44848958[/embed]</p>\n<p>You can also try the CMS interface in a different language with the following logins:</p>\n<ul><li>German (Username: \"german\", password: \"password\")</li>\n<li>French (Username: \"french\", password: \"password\")</li>\n<li>Spanish (Username: \"spanish\", password: \"password\")</li>\n<li>Chinese (Username: \"chinese\", password: \"password\")</li>\n<li>Te Reo/Māori (Username: \"tereo\", password: \"password\")</li>\n</ul><p>More languages are available in the <a href=\"http://admin/myprofile\">profile settings</a>.</p>\n</div>','Welcome to the SilverStripe Open Source CMS demo','this is my test of this website template...','silverstripe 3, demo, cms, html5, open source content management system, php',1,1,NULL,0,1,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',0,0,0,252,NULL,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(6605,'Page','2009-01-12 23:05:55','2009-07-23 09:50:08','intergalactic-twisty-thing','Intergalactic Twisty Thing',NULL,'<p>An example \'sci-fi\' movie product. Part Black Hole, part Star Wars and completely imaginary.</p>','A different sci-fi DVD',NULL,NULL,1,1,NULL,0,2,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',0,0,6603,42,NULL,NULL,NULL,'Inherit','Inherit','en_US',0,0,0),
	(6620,'Page','2009-01-13 11:26:37','2009-07-23 09:50:08','the-horror','Bloody Knife',NULL,'<p>A terrifying product inside the horror product group.</p>','The Horror',NULL,NULL,1,1,NULL,0,1,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',0,0,6619,32,NULL,NULL,NULL,'Inherit','Inherit','en_US',0,0,0),
	(6621,'Page','2009-01-13 11:27:27','2009-07-23 09:50:08','silhouetted-against-the-moon','Silhouetted Against the Moon',NULL,'<p>A frightful product nested in the horror product group.</p>','Horror 2',NULL,NULL,1,1,NULL,0,2,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',0,0,6619,27,NULL,NULL,NULL,'Inherit','Inherit','en_US',0,0,0),
	(102,'Page','2007-10-01 12:47:24','2012-06-29 13:52:24','about','About',NULL,'<h2 style=\"text-align: left;\">SilverStripe is a friendly and flexible open source CMS.</h2>\n<p>It\'s designed to be super easy to update content, and to let designers and developers build rich, amazing, websites.</p>\n<p>It\'s been downloaded about 500,000 times and powers websites for government agencies, corporations, non profits, and a large number of much smaller websites.</p>\n<p>It\'s created by SilverStripe Ltd, pictured below, together with a vibrant open source community.</p>\n<p><em>(Try resizing this image in the <a href=\"http://demo.silverstripe.com/admin/\">CMS</a>! When you save the page, it is resampled.)</em></p>\n<p style=\"text-align: left;\"><em><img class=\"left\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage500131-New-Team-Photo.jpg\" alt=\"New-Team-Photo.jpg\" width=\"500\" height=\"131\"/><br/></em></p>\n<p style=\"text-align: left;\"> </p>\n<p style=\"text-align: left;\">To find out more - and to download the SilverStripe CMS - please visit <a href=\"http://www.silverstripe.org\">silverstripe.org</a>.</p>',NULL,NULL,NULL,1,1,NULL,0,2,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,78,1,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(202,'Page','2007-10-01 12:47:24','2012-06-29 13:48:26','contact-us','Contact Us',NULL,'<p style=\"text-align: left;\">You can fill this page with your own content or delete it and create your own pages.</p>\n<table style=\"text-align: left;\" summary=\"Listing of SilverStripe\'s contact information\" border=\"0\"><tbody><tr><td>Phone </td>\n<td>+123 456 7890</td>\n</tr><tr><td>Email</td>\n<td>support at website.com </td>\n</tr><tr><td>Postal Address</td>\n<td>123 Street Name<br/> Neighborhood<br/> City</td>\n</tr></tbody></table>',NULL,NULL,NULL,1,1,NULL,0,4,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,79,1,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(6674,'Page','2012-05-25 08:28:48','2012-06-29 13:49:50','responsive','Responsive',NULL,'<p>Reduce the width of your browser window to the length of this line.</p>\n<p>The menus and other elements of the page will change to be mobile friendly.</p>\n<p>Or, view this page on your favourite smartphone.</p>\n<p>That\'s called a responsive design, a technique made possible using HTML5. This behaviour is provided by the default SilverStripe 3 theme, named Simple.</p>\n<p><img class=\"left\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage378567-iPhoneSimple.PNG\" alt=\"iPhone screenshot of Simple\" width=\"378\" height=\"567\"/></p>','Responsive',NULL,NULL,1,1,NULL,0,5,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,6686,10,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(702,'Page','2007-10-01 13:19:58','2009-07-23 09:50:08','dvds','DVDs',NULL,'<p>This is a nested product group. You can add a paragraph here to describe what this product group is about.</p>','DVDs',NULL,NULL,1,1,NULL,0,1,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,602,23,0.9,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(902,'Page','2007-10-01 13:19:58','2009-07-23 09:50:08','daft-robot','Daft Robot',NULL,'<p>A stellar example of a product page inside the Sci-fi product group.</p>','Sci-fi DVD',NULL,NULL,1,1,NULL,0,1,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,6603,55,0.8,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(1302,'Page','2007-10-01 13:47:31','2012-06-29 13:48:38','the-site-tree','The site tree',NULL,'<h2 style=\"text-align: left;\">SilverStripe CMS lets you structure the website in a logical, organised way by \"nesting\" pages in a hierarchy.</h2>\n<p>As you alter the site tree shown below, menus and lists throughout the website are updated. Clicking on a page in the site tree lets you edit that page.</p>\n<p><img class=\"left\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage600359-screenshot-sitetree.png\" alt=\"screenshot sitetree\" height=\"359\" width=\"600\"/></p>',NULL,NULL,NULL,1,1,NULL,0,3,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,102,62,0.9,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(6603,'Page','2009-01-12 22:59:55','2009-07-23 09:50:08','science-fiction','Science Fiction',NULL,'<p></p>','Sci-fi',NULL,NULL,1,1,NULL,0,2,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',0,0,702,11,NULL,NULL,NULL,'Inherit','Inherit','en_US',0,0,0),
	(6619,'Page','2009-01-13 11:26:13','2009-07-23 09:50:08','horror','Horror',NULL,'<p></p>','Horror',NULL,NULL,1,1,NULL,0,3,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',0,0,702,5,NULL,NULL,NULL,'Inherit','Inherit','en_US',0,0,0),
	(502,'ErrorPage','2007-10-01 12:47:25','2012-08-29 10:03:38','page-not-found','Page not found',NULL,'<p style=\"text-align: left;\">Sorry, it seems you were trying to access a page that doesn\'t exist.</p>\n<p style=\"text-align: left;\">Please check the spelling of the URL you were trying to access and try again.</p>',NULL,NULL,NULL,0,0,NULL,0,5,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,15,1,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(6676,'Page','2012-05-25 10:09:09','2012-06-29 13:49:09','beautiful-interface','Beautiful interface',NULL,'<p>The first thing you\'ll notice a entirely refreshed content management user interface. Developers will appreciate it is built on HTML5 and jQuery, but content authors will just love that they can do their work more quickly, using a beautiful user interface. </p>\n<p><img class=\"leftAlone\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage750552-Screen-Shot-2012-05-25-at-10.23.44-AM.png\" alt=\"Screen Shot of SS3 Interface\" width=\"750\" height=\"552\"/></p>','New Features',NULL,NULL,1,1,NULL,0,1,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,6686,12,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(6677,'Page','2012-05-25 10:11:31','2012-06-29 13:50:28','drop-images','Drop images',NULL,'<p>Uploading images is easier; just drag them into the insert image window from your desktop.</p>\n<p><img class=\"left\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage600424-Screen-Shot-2012-05-25-at-10.41.34-AM2.png\" alt=\"Drag drop image demo\" height=\"424\" width=\"600\"/></p>','Drop images',NULL,NULL,1,1,NULL,0,3,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,6686,6,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(4302,'Page','2007-11-20 12:56:41','2012-05-25 11:46:50','drag-and-drop-sitemap','Drag & drop sitemap',NULL,'<h2 style=\"text-align: left;\">The pages and files that make up the site tree of a SilverStripe website can be reshuffled by dragging and dropping them around.</h2>\n<p style=\"text-align: left;\">This makes re-arranging your site a fun and fast activity<em>.</em></p>\n<p style=\"text-align: left;\"><em><img class=\"left\" title=\"\" src=\"assets/Uploads/screenshot-dragdropsitemap.png\" alt=\"screenshot dragdrop sitemap\" height=\"298\" width=\"256\"/></em></p>\n<p><em> </em></p>\n<p> </p>\n<p> </p>\n<p> </p>','Drag & drop',NULL,NULL,1,1,NULL,0,2,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,102,36,0.9,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(6670,'ErrorPage','2010-08-19 12:31:00','2012-05-21 19:34:28','server-error','Server error',NULL,'<p>Sorry, there was a problem with handling your request.</p>',NULL,NULL,NULL,0,0,NULL,0,6,NULL,0,0,'New page',NULL,'Anyone','LoggedInUsers',0,0,0,2,NULL,NULL,NULL,'Inherit','Inherit','en_US',0,0,0),
	(6673,'','2012-05-24 17:33:58','2012-08-29 10:02:20','gridfieldtest','GridField',NULL,'<p>A <em>GridField</em> enables you to manage databases and lists of information stored on your website. It provides filtering, searching, adding, editing, importing, and exporting capabilities. A GridField can also manage relationships, such as letting you create a list of companies, and a list of people, and then connecting which people work for which companies.</p>\n<ul><li>A GridField can be added to a page. (E.g. to manage a list of image or text items relating to a particular page.) </li>\n<li>A GridField can be made into a full CMS section, through the use of ModelAdmin. (E.g. to manage a list of items that relate to the website as a whole.)</li>\n<li>A GridField can be displayed as a web page, and can even be made editable publicly as shown below.</li>\n</ul><p>SilverStripe CMS also uses GridField for <a href=\"[sitetree_link,id=6682]\">Listview</a>, Files, and Security features, resulting in a consistent and user friendly interface.</p>',NULL,NULL,NULL,1,1,NULL,0,4,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,7204,24,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(6672,'Page','2012-05-24 17:32:21','2012-06-29 13:49:09','media-insertion','Media insertion',NULL,'<p>You can insert media from a variety of sites into your page, thanks to the magic of oEmbed! Just click the \"insert media\" button (it looks like a picture of a tree) and enter the URL of your video (youtube, vimeo), photo (flickr, or URL), or presentation (slideshare).</p>\n<p><img class=\"left\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage600327-media-inserter.png\" alt=\"media inserter demo\" height=\"327\" width=\"600\"/></p>\n<p>Example embedded of video:</p>\n<div class=\"captionImage center\" style=\"width: 600px;\">[embed width=600 height=337 class=center thumbnail=http://b.vimeocdn.com/ts/103/759/103759717_640.jpg?r]http://vimeo.com/16842606[/embed]\n<p class=\"caption\">You can also embed SlideShare presentations.</p>\n<p class=\"caption\">[embed width=425 height=355 class=left thumbnail=http://www.slideshare.net/silverstripe/silverstripe-participates-in-gsoc-2012?r]http://www.slideshare.net/silverstripe/silverstripe-participates-in-gsoc-2012[/embed]</p>\n</div>','Media insertion',NULL,NULL,1,1,NULL,0,1,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,6686,15,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(6679,'Page','2012-05-25 11:31:30','2012-05-25 11:55:57','easy-page-editing','Easy page editing',NULL,'<p>It\'s easy to locate a page to edit, and a rich-text editor makes content updating very easy. Adding pages, links, images, and videos can all be done from your web browser without technical or HTML knowledge.</p>\n<p>A site can have any number of page <em>types</em>, each with their own editable fields, templates, and behaviour. A developer can invent new types of fields and behaviour both in the CMS and for the public-facing website. This enables both the CMS and the website to be perfectly tailored to suit requirements.</p>\n<p>The notion of a Draft and Published site enables you to save and preview your changes before the public see it.</p>\n<p><img class=\"left\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage600421-screenshot-3-general.png\" alt=\"screenshot 3 general\" height=\"421\" width=\"600\"/></p>\n<p> </p>','Easy page editing',NULL,NULL,1,1,NULL,0,1,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,102,5,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(6678,'Page','2012-05-25 10:58:19','2012-08-29 10:17:37','styles','Styles',NULL,'<p>Pages of your website should be typographically consistent. Content authors can choose from a list of styles by a designer (in a CSS file). Removing the option for content authors to chose font colours and faces produces better professionalism of the website, and makes the editing interface simpler. It also means you can later change the visual apperance or theme of your website without altering your written content.</p>\n<h1>Heading One</h1>\n<h2>Heading Two</h2>\n<h3>Heading Three</h3>\n<p>Normal text, <a href=\"[sitetree_link,id=86]\">hyperlinks</a>, <strong>bold</strong>, and <em>italics</em>.</p>\n<blockquote>\n<p>Quote. Quote. Quote.</p>\n</blockquote>\n<p>You can insert symbols © and SilverStripe supports characters from languages across the globe. ÄÃ¨Ã­Ã¸Ã¼.</p>\n<ul><li>Bullet One</li>\n<li>Bullet Two</li>\n<li>Bullet Three</li>\n</ul>','Styles',NULL,NULL,1,1,NULL,0,4,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,102,5,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(6680,'Page','2012-05-25 11:46:39','2012-06-29 08:41:36','under-the-hood','Under the hood',NULL,'<p>Behind the clean CMS and website presentation sits <a href=\"http://www.silverstripe.org/framework-introduction/\">SilverStripe Framework</a>. Website developers use the framework to write code to create templates, logic, and tailor how the CMS works. Developers get the power and flexibility of (object oriented PHP 5.3+) code, designers get the freedom of HTML5 and CSS, and content authors get the simplicity of a tailored CMS.</p>\n<p><img class=\"leftAlone\" title=\"\" src=\"assets/Uploads/silverstripe-php-code-sample.png\" alt=\"silverstripe php code sample\" width=\"298\" height=\"162\"/></p>',NULL,NULL,NULL,1,1,NULL,0,6,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,102,5,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(6681,'Page','2012-05-25 13:52:37','2012-05-25 14:04:01','security-and-audit-trail','Security & Audit Trail',NULL,'<p>Every save made to a page contributes to an audit trail. You can compare old versions with each other and roll back to them in the History Tab.</p>\n<p>A powerful security system allows viewing and editing of pages to be restricted to various users. Users and groups can be created, and this can all provide the basis for secure login areas or more elaborate publishing workflow.</p>\n<p><img class=\"leftAlone\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage600421-silverstripe-security-page.png\" alt=\"silverstripe security page\" height=\"421\" width=\"600\"/></p>','Security & Audit Trail',NULL,NULL,1,1,NULL,0,5,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,102,6,NULL,NULL,NULL,'Anyone','OnlyTheseUsers',NULL,0,0,0),
	(6682,'Page','2012-06-28 13:00:19','2012-06-29 13:44:35','listview','Listview',NULL,'<p>ListView makes finding and updating pages on very large sites considerably easier. In the CMS, while browsing the familiar site tree, click the  Treeview icon. Now you can work with the site tree using filters and paginated lists.</p>\n<p><img class=\"left\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage699514-listview-509rows-screenshot.png\" alt=\"listview 509rows screenshot\" width=\"699\" height=\"514\"/></p>','Treeview',NULL,NULL,1,1,NULL,0,2,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,6686,11,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
