	(6002,1802,2,1,86,86,'','2007-10-01 15:45:33','2007-10-01 15:45:33','sample-blog-entry','SilverStripe blog module successfully installed',NULL,'Congratulations, the SilverStripe blog module has been successfully installed. This blog entry can be safely deleted. You can configure aspects of your blog (such as the widgets displayed in the sidebar) in [url=admin]the CMS[/url].',NULL,NULL,NULL,1,1,NULL,1,0,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',0,0,1702,NULL,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(6102,86,7,1,86,86,'Page','2007-10-01 12:47:24','2007-10-01 14:26:04','home','Welcome to the SilverStripe open-source CMS demo','Home','<ul><li>Browse this demo site, or</li><li>Login to the <a href=\"http://demo.silverstripe.com/admin/\">Administration area</a> (email: &quot;admin&quot;, password: &quot;password&quot;)</li><li><a href=\"http://www.silverstripe.com/silverstripe-web-application-framework/\">Download SilverStripe for free</a> and start the <a href=\"http://doc.silverstripe.com/\">developer tutorials</a>!</li><li>Put questions and feedback in our <a href=\"http://www.silverstripe.com/silverstripe-forum/\">forum</a> or <a href=\"http://www.silverstripe.com/contact/\">contact us</a> </li></ul><p><br />Thanks,<br />The team at SilverStripe</p><p><img src=\"assets/Uploads/_resampled/ResizedImage241153-silverstripe-company-core-team-photo.jpg\" width=\"241\" height=\"153\"  /> </p>',NULL,NULL,NULL,1,1,NULL,0,1,NULL,1,0,'Published',NULL,'Anyone','LoggedInUsers',86,86,0,NULL,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
