	(6402,102,6,1,86,86,'Page','2007-10-01 12:47:24','2007-10-01 13:46:53','about-us','About Us',NULL,'<p>We\'ve built over 100 fantastic websites, intranets and web applications since 2000. </p><p>Our people are, prompt, professional, capable and great to work with.</p><p><em>Try resizing this image in the <a href=\"http://demo.silverstripe.com/admin/\">CMS</a>! When you save the page, it is resampled.</em></p><p><img src=\"assets/Uploads/_resampled/ResizedImage473301-silverstripe-company-core-team-photo.jpg\" width=\"473\" height=\"301\"  /></p><p>The technology we work with is open source (we\'ll never lock you in), easy to use, and cutting edge.</p><p>To find out more, and to download the SilverStripe CMS - please visit <a href=\"http://www.silverstripe.com\">www.silverstripe.com</a>.</p>',NULL,NULL,NULL,1,1,NULL,0,2,NULL,1,0,'Published',NULL,'Anyone','LoggedInUsers',86,86,0,NULL,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
