	(6602,302,2,1,86,86,'','2007-10-01 12:47:24','2007-10-01 12:47:24','forums','Forums',NULL,'<p>Welcome to SilverStripe Forum Module! This is the default ForumHolder page. You can now add forums.</p>',NULL,NULL,NULL,1,1,NULL,0,4,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',0,0,0,NULL,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
