	(6802,602,2,1,86,86,'','2007-10-01 13:19:58','2007-10-01 13:19:58','products','Products',NULL,'<p>This is the top level products page, it uses the <em>product group</em> page type, and it allows you to show your products checked as \'featured\' on it. It also allows you to nest <em>product group</em> pages inside it.</p>\n						<p>For example, you have a product group called \'DVDs\', and inside you have more product groups like \'sci-fi\', \'horrors\' or \'action\'.</p>\n						<p>In this example we have setup a main product group (this page), with a nested product group containing 2 example products.</p>',NULL,NULL,NULL,1,1,NULL,0,6,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',0,0,0,NULL,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
