	(7002,1102,2,1,86,86,'','2007-10-01 13:19:58','2007-10-01 13:19:58','account','Account',NULL,'<p>This is the account page. It is used for shop users to login and change their member details if they have an account.</p>',NULL,NULL,NULL,0,1,NULL,0,8,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',0,0,0,NULL,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(7102,1202,2,1,86,86,'Page','2007-10-01 13:19:59','2007-10-01 13:19:59','terms-and-conditions','Terms and Conditions',NULL,'<p>You can place your shop\'s terms and conditions here, if this page exists a checkbox will appear on the order form on the checkout page, so a user has to confirm they agree to these terms and conditions here.</p>',NULL,NULL,NULL,0,1,NULL,0,9,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',0,0,0,NULL,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(7202,1402,9,1,86,86,'','2007-10-01 13:48:30','2007-10-01 13:53:36','flickr','Flickr',NULL,'<p>By default, we show photos below tagged as \'<a href=\"http://flickr.com/photos/tags/landscapes/\">landscapes</a>\' from <a href=\"http://www.flickr.com/\">Flickr</a>. This is an example of the <a href=\"http://www.silverstripe.com/silverstripe-modules/\">free mashups module</a>, which is part of the <a href=\"http://code.google.com/soc/2007\">Google Summer of Code</a>.</p><p>Please leave your comments for Lakshan and Matt in <a href=\"http://www.silverstripe.com/google-summer-of-code-forum/flat/1931\">the SilverStripe forum</a>.</p>',NULL,NULL,NULL,1,1,NULL,0,10,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',86,86,0,NULL,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
