	(15502,1602,18,0,1,0,'Page','2007-10-01 14:28:18','2007-11-13 14:38:48','gallery','Gallery',NULL,'<p>By default, we show images which are stored on the website. But we also have the possibility to load sounds, videos, pdf files and so on...</p> <p>The <a href=\"http://doc.silverstripe.com/doku.php?id=modules:gallery\">Gallery module</a> uses the <a href=\"http://stickmanlabs.com/lightwindow\">Lightwindow 2.0</a> to show and read these media files.</p> <p>Please leave your comments to Romain in <a href=\"http://www.silverstripe.com/extending-hacking-silverstripe-forum/show/8130\">the SilverStripe forum</a>.</p>',NULL,NULL,NULL,1,1,NULL,0,12,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(15602,202,13,0,1,0,'Page','2007-10-01 12:47:24','2007-10-01 15:50:37','contact-us','Contact Us',NULL,'<p>You can fill this page out with your own content, or delete it and create your own pages.</p><p>Contact us</p><table border=\"0\"><tbody><tr><td>Phone&nbsp;</td><td>+644 978 7330&nbsp;</td></tr><tr><td>&nbsp;Email</td><td>support at silverstripe.com&nbsp;</td></tr><tr><td>&nbsp;Postal</td><td>PO BOX 11804, Wellington&nbsp;</td></tr><tr><td>&nbsp;Physical Address<br /></td><td>Level 5, 97-99 Courtenay Place, Wellington&nbsp;</td></tr></tbody></table><p>The CMS allows you to build simple forms that email and store data...</p><p><img src=\"assets/Uploads/_resampled/ResizedImage600387-form-editor.JPG\" width=\"600\" height=\"387\" /><br />&nbsp;</p><h2>Contact Form</h2>',NULL,NULL,NULL,1,1,NULL,0,13,NULL,1,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
