	(26402,4302,8,0,1,0,'Page','2007-11-20 12:56:41','2007-11-20 13:01:45','drag-drop-me','Drag & Drop me',NULL,'<p>The sitemap of a SilverStripe website, as with lists of articles and products, can be reshuffled by dragging and dropping them around, making re-arranging your site a fun and fast activity.</p><p><em>Just tick the &quot;Drag &amp; Demo reordering&quot; to use the feature.</em> </p><p><img class=\"left\" src=\"assets/Uploads/_resampled/ResizedImage358412-dragndrop-demo.PNG\" alt=\"drag n drop demo screenshot\" title=\"null\" hspace=\"null\" vspace=\"null\" width=\"358\" height=\"412\" align=\"null\"   /> </p><p>&nbsp;</p><p>&nbsp;</p>','Drag & Drop me',NULL,NULL,1,1,NULL,0,2,NULL,1,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,102,0.9,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(26502,4402,12,0,1,0,'Page','2007-11-20 13:07:46','2007-11-20 13:17:54','image-editing','Image Editing',NULL,'<p>As you go to insert an image, or if you have an image already on your page, you can crop, resize and rotate it online. This saves you heaps of time as you go about the process of taking images from your camera, your computer, or other websites, and get them to look professional on your website.</p><p>&nbsp;</p><p><img class=\"center\" src=\"assets/Photos/_resampled/ResizedImage530329-opening-image-editor.png\" title=\"null\" hspace=\"null\" vspace=\"null\" width=\"530\" height=\"329\" align=\"null\"   /></p><p>&nbsp;</p><p>&nbsp;</p><p><img class=\"center\" src=\"assets/Photos/_resampled/ResizedImage530328-using-image-editor.png\" title=\"null\" hspace=\"null\" vspace=\"null\" width=\"530\" height=\"328\" align=\"null\"   /></p>','Image Editing',NULL,NULL,1,1,NULL,0,3,NULL,1,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,102,0.9,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(26602,4402,13,0,1,0,'Page','2007-11-20 13:07:46','2007-11-20 13:17:54','image-editing','Image Editing',NULL,'<p>As you go to insert an image, or if you have an image already on your page, you can crop, resize and rotate it online. This saves you heaps of time as you go about the process of taking images from your camera, your computer, or other websites, and get them to look professional on your website.</p><p>&nbsp;</p><p><img class=\"center\" src=\"assets/Photos/_resampled/ResizedImage530329-opening-image-editor.png\" title=\"null\" hspace=\"null\" vspace=\"null\" width=\"530\" height=\"329\" align=\"null\"   /></p><p>&nbsp;</p><p>&nbsp;</p><p><img class=\"center\" src=\"assets/Photos/_resampled/ResizedImage530328-using-image-editor.png\" title=\"null\" hspace=\"null\" vspace=\"null\" width=\"530\" height=\"328\" align=\"null\"   /></p>','Image Editing',NULL,NULL,1,1,NULL,0,3,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,102,0.9,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
