	(27702,202,27,0,1,0,'Page','2007-10-01 12:47:24','2007-11-21 09:53:58','contact-us','Contact Us',NULL,'<p>You can fill this page out with your own content, or delete it and create your own pages.</p><p>Contact us</p><table border=\"0\"><tbody><tr><td>Phone&nbsp;</td><td>+644 978 7330&nbsp;</td></tr><tr><td>&nbsp;Email</td><td>support at silverstripe.com&nbsp;</td></tr><tr><td>&nbsp;Postal</td><td>PO BOX 11804, Wellington&nbsp;</td></tr><tr><td>&nbsp;Physical Address<br /></td><td>Level 5, 97-99 Courtenay Place, Wellington&nbsp;</td></tr></tbody></table><p>The CMS allows you to build simple forms that email and store data...</p><p><img class=\"left\" src=\"assets/Uploads/_resampled/ResizedImage600366-form-editor.png\" title=\"null\" hspace=\"null\" vspace=\"null\" width=\"600\" height=\"366\" align=\"null\"   /><br />&nbsp;</p><h2>Contact Form</h2>',NULL,NULL,NULL,1,1,NULL,0,13,NULL,1,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(27802,86,42,1,1,1,'Page','2007-10-01 12:47:24','2007-11-21 09:56:41','home','Welcome to the SilverStripe open-source CMS demo','Home','<ul><li>Browse this demo site in English or in <a href=\"home/?lang=fr\" title=\"SilverStripe demo site in french\">French</a></li><li>Login to the&nbsp;<a href=\"admin/\" class=\"broken\"> Administration system as admin / password.</a><em><br />Replace &quot;admin&quot; with &quot;french&quot;, &quot;german&quot;, &quot;chinese&quot; or &quot;spanish&quot; to see the system in another language.</em></li></ul><ul><li><a href=\"http://www.silverstripe.com/silverstripe-web-application-framework/\">Download SilverStripe for free</a> and start the <a href=\"http://doc.silverstripe.com/doku.php?id=tutorials\">developer tutorials</a>!</li><li>Put questions and feedback in our <a href=\"http://www.silverstripe.com/silverstripe-forum/\">forum</a> or <a href=\"http://www.silverstripe.com/contact/\">contact us</a></li></ul><ul><li>You\'re seeing the default BlackCandy theme. Our <a href=\"http://www.silverstripe.com/showcase\">showcase</a> demonstrates your design freedom.</li></ul><br /><p><br />Thanks,<br />The team at SilverStripe</p><p><img src=\"assets/Uploads/_resampled/ResizedImage241153-silverstripe-company-core-team-photo.jpg\" width=\"241\" height=\"153\" /> </p>',NULL,NULL,NULL,1,1,NULL,0,1,NULL,1,1,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(27902,402,4,1,1,1,'','2007-10-01 12:47:25','2007-11-21 09:56:41','general-discussion','General Discussion',NULL,'<p>Welcome to SilverStripe Forum Module! This is the default Forum page. You can now add topics.</p>',NULL,NULL,NULL,1,1,NULL,0,1,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,302,0.9,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(28002,702,4,1,1,1,'','2007-10-01 13:19:58','2007-11-21 09:56:41','example-product-group','Example product group',NULL,'<p>This is a nested <em>product group</em> within the main <em>product group</em> page. You can add a paragraph here to describe what this product group is about, and what sort of products you can expect to find in it.</p>',NULL,NULL,NULL,1,1,NULL,0,1,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,602,0.9,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(28102,902,7,1,1,1,'','2007-10-01 13:19:58','2007-11-21 09:56:42','example-product-2','Example product 2',NULL,'<p>This is a <em>product</em>. It\'s description goes into the Content field as a standard SilverStripe page would have it\'s content. This is an ideal place to describe your product.</p>',NULL,NULL,NULL,1,1,NULL,0,1,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,702,0.8,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(28202,1302,22,1,1,1,'Page','2007-10-01 13:47:31','2007-11-21 09:56:42','subpage-demo','Subpage demo',NULL,'<p>SilverStripe lets you structure the website in a logical, organised way by &quot;nesting&quot; pages in a heirarchy, which people associate as being a sitemap.</p><p>(When you build templates you define to choose how to lay out your menus.)</p><p>The sitemap is shown obviously in the administration system:</p><p>&nbsp;</p><div><img class=\"left\" src=\"assets/Uploads/_resampled/ResizedImage358412-dragndrop-demo.PNG\" title=\"null\" hspace=\"null\" vspace=\"null\" width=\"358\" height=\"412\"   /></div><p>&nbsp;</p>',NULL,NULL,NULL,1,1,NULL,0,1,NULL,1,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,102,0.9,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(28302,1802,8,1,1,1,'','2007-10-01 15:45:33','2007-11-21 09:56:42','sample-blog-entry','SilverStripe blog module successfully installed',NULL,'Congratulations, the SilverStripe blog module has been successfully installed. This blog entry can be safely deleted. You can configure aspects of your blog (such as the widgets displayed in the sidebar) in [url=admin]the CMS[/url].',NULL,NULL,NULL,1,1,NULL,1,1,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,1702,0.9,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(28402,102,19,1,1,1,'Page','2007-10-01 12:47:24','2007-11-21 09:56:42','about-us','About Us',NULL,'<p>We\'ve built over 200 fantastic websites, intranets and web applications since 2000. </p><p>Our people are, prompt, professional, capable and great to work with.</p><p><em>Try resizing this image in the <a href=\"http://demo.silverstripe.com/admin/\">CMS</a>! When you save the page, it is resampled.</em></p><p><em>Try rotating and cropping photos online with our online <a href=\"image-editing/\">image editor</a>.</em>  </p><p><img src=\"assets/Uploads/_resampled/ResizedImage473301-silverstripe-company-core-team-photo.jpg\" width=\"473\" height=\"301\" /></p><p>The technology we work with is open source (we\'ll never lock you in), easy to use, and cutting edge.</p><p>To find out more, and to download the SilverStripe CMS - please visit <a href=\"http://www.silverstripe.com\">www.silverstripe.com</a>.</p>',NULL,NULL,NULL,1,1,NULL,0,2,NULL,1,1,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(28502,802,7,1,1,1,'','2007-10-01 13:19:58','2007-11-21 09:56:42','example-product','Example product',NULL,'<p>This is a <em>product</em>. It\'s description goes into the Content field as a standard SilverStripe page would have it\'s content. This is an ideal place to describe your product.</p> 												<p>You may also notice that we have checked it as a featured product and it will display on the main Products page.</p>',NULL,NULL,NULL,1,1,NULL,0,2,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,702,0.8,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(28602,1902,8,1,1,1,'','2007-10-02 10:42:00','2007-11-21 09:56:42','commenting','Commenting',NULL,'Commenting is available on all SilverStripe pages - simply check a single checkbox in the CMS and you get a fully fledged AJAX commenting system that checks for spam.\n\n[img]assets/Uploads/_resampled/ResizedImage600293-Blog-Tickbox.JPG[/img]\n',NULL,NULL,NULL,1,1,NULL,1,2,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,1702,0.9,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(28702,4302,9,1,1,1,'Page','2007-11-20 12:56:41','2007-11-21 09:56:42','drag-drop-me','Drag & Drop me',NULL,'<p>The sitemap of a SilverStripe website, as with lists of articles and products, can be reshuffled by dragging and dropping them around, making re-arranging your site a fun and fast activity.</p><p><em>Just tick the &quot;Drag &amp; Demo reordering&quot; to use the feature.</em> </p><p><img class=\"left\" src=\"assets/Uploads/_resampled/ResizedImage358412-dragndrop-demo.PNG\" alt=\"drag n drop demo screenshot\" title=\"null\" hspace=\"null\" vspace=\"null\" width=\"358\" height=\"412\" align=\"null\"   /> </p><p>&nbsp;</p><p>&nbsp;</p>','Drag & Drop me',NULL,NULL,1,1,NULL,0,2,NULL,1,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,102,0.9,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(28802,1702,16,1,1,1,'','2007-10-01 15:45:33','2007-11-21 09:56:42','blog','Blog',NULL,NULL,NULL,NULL,NULL,1,1,NULL,0,3,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(28902,4402,15,1,1,1,'Page','2007-11-20 13:07:46','2007-11-21 09:56:42','image-editing','Image Editing',NULL,'<p>As you go to insert an image, or if you have an image already on your page, you can crop, resize and rotate it online. This saves you heaps of time as you go about the process of taking images from your camera, your computer, or other websites, and get them to look professional on your website.</p><p>&nbsp;</p><p><img class=\"center\" src=\"assets/Photos/_resampled/ResizedImage530329-opening-image-editor.png\" title=\"null\" hspace=\"null\" vspace=\"null\" width=\"530\" height=\"329\" align=\"null\"   /></p><p>&nbsp;</p><p>&nbsp;</p><p><img class=\"center\" src=\"assets/Photos/_resampled/ResizedImage530328-using-image-editor.png\" title=\"null\" hspace=\"null\" vspace=\"null\" width=\"530\" height=\"328\" align=\"null\"   /></p>','Image Editing',NULL,NULL,1,1,NULL,0,3,NULL,1,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,102,0.9,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(29002,302,8,1,1,1,'','2007-10-01 12:47:24','2007-11-21 09:56:42','forums','Forums',NULL,'<p>Welcome to SilverStripe Forum Module! This is the default ForumHolder page. You can now add forums.</p>',NULL,NULL,NULL,1,1,NULL,0,4,NULL,0,1,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(29102,502,6,1,1,1,'ErrorPage','2007-10-01 12:47:25','2007-11-21 09:56:42','page-not-found','Page not found',NULL,'<p>Sorry, it seems you were trying to access a page that doesn\'t exist.</p><p>Please check the spelling of the URL you were trying to access and try again.</p>',NULL,NULL,NULL,0,1,NULL,0,5,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(29202,602,16,1,1,1,'','2007-10-01 13:19:58','2007-11-21 09:56:42','ecommerce','Ecommerce',NULL,'<p>This is the top level products page, it uses the <em>product group</em> page type, and it allows you to show your products checked as \'featured\' on it. It also allows you to nest <em>product group</em> pages inside it.</p> 						<p>For example, you have a product group called \'DVDs\', and inside you have more product groups like \'sci-fi\', \'horrors\' or \'action\'.</p> 						<p>In this example we have setup a main product group (this page), with a nested product group containing 2 example products.</p>',NULL,NULL,NULL,1,1,NULL,0,6,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(29302,1002,4,1,1,1,'','2007-10-01 13:19:58','2007-11-21 09:56:42','checkout','Checkout',NULL,'<p>This is the checkout page. The order summary and order form appear below this content.</p>',NULL,NULL,NULL,0,1,NULL,0,7,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(29402,1102,4,1,1,1,'','2007-10-01 13:19:58','2007-11-21 09:56:42','account','Account',NULL,'<p>This is the account page. It is used for shop users to login and change their member details if they have an account.</p>',NULL,NULL,NULL,0,1,NULL,0,8,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(29502,1202,4,1,1,1,'Page','2007-10-01 13:19:59','2007-11-21 09:56:42','terms-and-conditions','Terms and Conditions',NULL,'<p>You can place your shop\'s terms and conditions here, if this page exists a checkbox will appear on the order form on the checkout page, so a user has to confirm they agree to these terms and conditions here.</p>',NULL,NULL,NULL,0,1,NULL,0,9,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(29602,1402,24,1,1,1,'','2007-10-01 13:48:30','2007-11-21 09:56:42','flickr','Flickr',NULL,'<p>By default, we show photos below tagged as \'<a href=\"http://flickr.com/photos/tags/landscapes/\">landscapes</a>\' from <a href=\"http://www.flickr.com/\">Flickr</a>. This is an example of the <a href=\"http://www.silverstripe.com/silverstripe-modules/\">free mashups module</a>, which is part of the <a href=\"http://code.google.com/soc/2007\">Google Summer of Code</a>.</p><p>Please leave your comments for Lakshan and Matt in <a href=\"http://www.silverstripe.com/google-summer-of-code-forum/flat/1931\">the SilverStripe forum</a>.</p>',NULL,NULL,NULL,1,1,NULL,0,10,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(29702,1502,9,1,1,1,'','2007-10-01 13:55:48','2007-11-21 09:56:42','member-map','Member Map','Map','<p>Where in the world are our forum members located? This demonstrates the <a href=\"http://www.silverstripe.com/silverstripe-modules/\">free maps module</a>.</p><p>&nbsp;</p>',NULL,NULL,NULL,1,1,NULL,0,11,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(29802,1602,23,1,1,1,'Page','2007-10-01 14:28:18','2007-11-21 09:56:42','gallery','Gallery',NULL,'<p>By default, we show images which are stored on the website. But we also have the possibility to load sounds, videos, pdf files and so on...</p> <p>The <a href=\"http://doc.silverstripe.com/doku.php?id=modules:gallery\">Gallery module</a> uses the <a href=\"http://stickmanlabs.com/lightwindow\">Lightwindow 2.0</a> to show and read these media files.</p> <p>Please leave your comments to Romain in <a href=\"http://www.silverstripe.com/extending-hacking-silverstripe-forum/show/8130\">the SilverStripe forum</a>.</p>',NULL,NULL,NULL,1,1,NULL,0,12,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(29902,202,28,1,1,1,'Page','2007-10-01 12:47:24','2007-11-21 09:56:42','contact-us','Contact Us',NULL,'<p>You can fill this page out with your own content, or delete it and create your own pages.</p><p>Contact us</p><table border=\"0\"><tbody><tr><td>Phone&nbsp;</td><td>+644 978 7330&nbsp;</td></tr><tr><td>&nbsp;Email</td><td>support at silverstripe.com&nbsp;</td></tr><tr><td>&nbsp;Postal</td><td>PO BOX 11804, Wellington&nbsp;</td></tr><tr><td>&nbsp;Physical Address<br /></td><td>Level 5, 97-99 Courtenay Place, Wellington&nbsp;</td></tr></tbody></table><p>The CMS allows you to build simple forms that email and store data...</p><p><img class=\"left\" src=\"assets/Uploads/_resampled/ResizedImage600366-form-editor.png\" title=\"null\" hspace=\"null\" vspace=\"null\" width=\"600\" height=\"366\" align=\"null\"   /><br />&nbsp;</p><h2>Contact Form</h2>',NULL,NULL,NULL,1,1,NULL,0,13,NULL,1,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(30002,4402,16,0,202,0,'Page','2007-11-20 13:07:46','2007-11-21 09:56:42','image-editing','Image Editing',NULL,'<p>As you go to insert an image, or if you have an image already on your page, you can crop, resize and rotate it online. This saves you heaps of time as you go about the process of taking images from your camera, your computer, or other websites, and get them to look professional on your website.</p><p>&nbsp;</p><p><img class=\"center\" src=\"assets/Photos/_resampled/ResizedImage530329-opening-image-editor.png\" title=\"null\" hspace=\"null\" vspace=\"null\" width=\"530\" height=\"329\" align=\"null\"   /></p><p>&nbsp;</p><p>&nbsp;</p><p><img class=\"center\" src=\"assets/Photos/_resampled/ResizedImage530328-using-image-editor.png\" title=\"null\" hspace=\"null\" vspace=\"null\" width=\"530\" height=\"328\" align=\"null\"   /></p>','Image Editing',NULL,NULL,1,1,NULL,0,3,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,102,0.9,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
