	(47988,1302,25,0,1,0,'Page','2007-10-01 13:47:31','2009-01-12 13:50:59','subpage-demo','Subpage demo',NULL,'<h2>SilverStripe lets you structure the website in a logical, organised way by \"nesting\" pages in a heirarchy, which people associate as being a sitemap.</h2>\n<p>(When you build templates you define to choose how to lay out your menus.)</p>\n<p>The sitemap is shown obviously in the administration system:</p>\n<div><img class=\"left\" title=\"null\" src=\"assets/Uploads/_resampled/ResizedImage358412-dragndrop-demo.PNG\" alt=\"\" hspace=\"null\" vspace=\"null\" width=\"358\" height=\"412\" /></div>\n<p>&nbsp;</p>',NULL,NULL,NULL,1,1,NULL,0,1,NULL,0,0,'Saved (update)',NULL,'Anyone','LoggedInUsers',1,1,102,0.9,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
