	(48054,1402,25,0,1,0,'','2007-10-01 13:48:30','2009-01-12 16:37:12','flickr','Flickr',NULL,'<p>You can pull in images from flickr with the flickr module. By default, we show photos below tagged as \'<a href=\"http://flickr.com/photos/tags/landscapes/\">landscapes</a>\' from <a href=\"http://www.flickr.com/\">Flickr</a>. This is an example of the <a href=\"http://www.silverstripe.com/silverstripe-modules/\">free mashups module</a>, which is part of the <a href=\"http://code.google.com/soc/2007\">Google Summer of Code</a>.</p>\n<p>Please leave your comments for Lakshan and Matt in <a href=\"http://www.silverstripe.com/google-summer-of-code-forum/flat/1931\">the SilverStripe forum</a>.</p>',NULL,NULL,NULL,1,1,NULL,0,10,NULL,0,0,'Saved (update)',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(48055,1402,26,1,1,1,'','2007-10-01 13:48:30','2009-01-12 16:37:12','flickr','Flickr',NULL,'<p>You can pull in images from flickr with the flickr module. By default, we show photos below tagged as \'<a href=\"http://flickr.com/photos/tags/landscapes/\">landscapes</a>\' from <a href=\"http://www.flickr.com/\">Flickr</a>. This is an example of the <a href=\"http://www.silverstripe.com/silverstripe-modules/\">free mashups module</a>, which is part of the <a href=\"http://code.google.com/soc/2007\">Google Summer of Code</a>.</p>\n<p>Please leave your comments for Lakshan and Matt in <a href=\"http://www.silverstripe.com/google-summer-of-code-forum/flat/1931\">the SilverStripe forum</a>.</p>',NULL,NULL,NULL,1,1,NULL,0,10,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(48056,1602,24,0,1,0,'Page','2007-10-01 14:28:18','2009-01-12 16:41:32','gallery','Gallery',NULL,'<p>By default, we show images which are stored on the website. You can also include sounds, videos, pdf files and so on...</p>\n<p>The <a href=\"http://doc.silverstripe.com/doku.php?id=modules:gallery\">Gallery module</a> uses the <a href=\"http://stickmanlabs.com/lightwindow\">Lightwindow 2.0</a> to show and read these media files.</p>\n<p>Please leave your comments to Romain in <a href=\"http://www.silverstripe.com/extending-hacking-silverstripe-forum/show/8130\">the SilverStripe forum</a>.</p>',NULL,NULL,NULL,1,1,NULL,0,12,NULL,0,0,'Saved (update)',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
