	(48096,602,21,0,1,0,'','2007-10-01 13:19:58','2009-01-12 21:35:15','ecommerce','Ecommerce',NULL,'<p>Silverstripe has a fully featured ecommerce module available for your site.</p>\n<p>This is the top level products page, it uses the <em>product group</em> page type, and it allows you to show your products checked as \'featured\' on it. It also allows you to nest <em>product group</em> pages inside it.</p>\n<p>For example, you have a product group called \'DVDs\', and inside you have more product groups like \'sci-fi\', \'horror\' or \'action\'.</p>\n<p>In this example we have setup a main product group (this page), with a nested product group containing 2 example products.</p>',NULL,NULL,NULL,1,1,NULL,0,6,NULL,0,0,'Saved (update)',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(48097,602,22,1,1,1,'','2007-10-01 13:19:58','2009-01-12 21:35:15','ecommerce','Ecommerce',NULL,'<p>Silverstripe has a fully featured ecommerce module available for your site.</p>\n<p>This is the top level products page, it uses the <em>product group</em> page type, and it allows you to show your products checked as \'featured\' on it. It also allows you to nest <em>product group</em> pages inside it.</p>\n<p>For example, you have a product group called \'DVDs\', and inside you have more product groups like \'sci-fi\', \'horror\' or \'action\'.</p>\n<p>In this example we have setup a main product group (this page), with a nested product group containing 2 example products.</p>',NULL,NULL,NULL,1,1,NULL,0,6,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(48098,702,5,0,1,0,'','2007-10-01 13:19:58','2009-01-12 21:35:38','dvds','DVDs',NULL,'<p>This is a nested <em>product group</em> within the main <em>product group</em> page. You can add a paragraph here to describe what this product group is about, and what sort of products you can expect to find in it.</p>','DVDs',NULL,NULL,1,1,NULL,0,1,NULL,0,0,'Saved (update)',NULL,'Anyone','LoggedInUsers',1,1,602,0.9,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
