	(48110,1302,41,0,1,0,'Page','2007-10-01 13:47:31','2009-01-12 21:54:22','subpage-demo','Subpage demo',NULL,'<h2 style=\"text-align: center;\">SilverStripe lets you structure the website in a logical, organised way by \"nesting\" pages in a hierarchy.<br /> (This is shown in a site tree -&nbsp; in the same way as files are shown on your PC).</h2>\n<p style=\"text-align: center;\">(When you build templates you define to choose how to lay out your menus.)</p>\n<p style=\"text-align: center;\">The sitemap is shown clearly in the administration system:</p>\n<div><img class=\"center\" title=\"null\" src=\"assets/Uploads/_resampled/ResizedImage358412-dragndrop-demo.PNG\" alt=\"\" hspace=\"null\" vspace=\"null\" width=\"358\" height=\"412\" /></div>\n<p>&nbsp;</p>',NULL,NULL,NULL,1,1,NULL,0,1,NULL,0,0,'Saved (update)',NULL,'Anyone','LoggedInUsers',1,1,102,0.9,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(48111,1302,42,1,1,1,'Page','2007-10-01 13:47:31','2009-01-12 21:54:22','subpage-demo','Subpage demo',NULL,'<h2 style=\"text-align: center;\">SilverStripe lets you structure the website in a logical, organised way by \"nesting\" pages in a hierarchy.<br /> (This is shown in a site tree -&nbsp; in the same way as files are shown on your PC).</h2>\n<p style=\"text-align: center;\">(When you build templates you define to choose how to lay out your menus.)</p>\n<p style=\"text-align: center;\">The sitemap is shown clearly in the administration system:</p>\n<div><img class=\"center\" title=\"null\" src=\"assets/Uploads/_resampled/ResizedImage358412-dragndrop-demo.PNG\" alt=\"\" hspace=\"null\" vspace=\"null\" width=\"358\" height=\"412\" /></div>\n<p>&nbsp;</p>',NULL,NULL,NULL,1,1,NULL,0,1,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,102,0.9,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(48112,4302,18,0,1,0,'Page','2007-11-20 12:56:41','2009-01-12 21:55:12','drag-drop','Drag & Drop',NULL,'<h2 style=\"text-align: center;\">The site tree of a SilverStripe website, as with lists of articles and products, can be reshuffled by<br />dragging and dropping them around. This makes re-arranging your site a fun and fast activity.</h2>\n<p style=\"text-align: center;\"><em>Just tick the \"Drag &amp; Demo reordering\" to use the feature.</em></p>\n<p><img class=\"center\" title=\"null\" src=\"assets/Uploads/_resampled/ResizedImage358412-dragndrop-demo.PNG\" alt=\"drag n drop demo screenshot\" hspace=\"null\" vspace=\"null\" width=\"358\" height=\"412\" align=\"null\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>','Drag & Drop me',NULL,NULL,1,1,NULL,0,2,NULL,0,0,'Saved (update)',NULL,'Anyone','LoggedInUsers',1,1,102,0.9,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
