	(48122,1402,33,0,1,0,'','2007-10-01 13:48:30','2009-01-12 22:02:37','flickr','Flickr',NULL,'<h2>You can pull in images from flickr with the flickr module.</h2>\n<p>For example below, we show photos below tagged as \'<a href=\"http://flickr.com/photos/tags/landscapes/\">landscapes</a>\' from <a href=\"http://www.flickr.com/\">Flickr</a>. This is an example of the <a href=\"http://www.silverstripe.com/silverstripe-modules/\">free mashups module</a>, which is part of the <a href=\"http://code.google.com/soc/2007\">Google Summer of Code</a>.</p>\n<p>Please leave your comments for Lakshan and Matt in <a href=\"http://www.silverstripe.com/google-summer-of-code-forum/flat/1931\">the SilverStripe forum</a>.</p>',NULL,NULL,NULL,1,1,NULL,0,10,NULL,0,0,'Saved (update)',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
