	(48163,602,23,0,1,0,'','2007-10-01 13:19:58','2009-01-12 23:05:29','ecommerce','Ecommerce',NULL,'<p>Silverstripe has a fully featured ecommerce module available for your site.</p>\n<p>This is the top level products page, it uses the <em>product group</em> page type, and it allows you to show your products checked as \'featured\' on it. It also allows you to nest <em>product group</em> pages inside it.</p>\n<p>For example, you have a product group called \'DVDs\', and inside you have more product groups like \'sci-fi\' or \'horror\'.</p>\n<p>In this example we have setup a main product group (this page), with a nested product group containing 2 example products.</p>',NULL,NULL,NULL,1,1,NULL,0,6,NULL,0,0,'Saved (update)',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
	(48164,602,24,1,1,1,'','2007-10-01 13:19:58','2009-01-12 23:05:29','ecommerce','Ecommerce',NULL,'<p>Silverstripe has a fully featured ecommerce module available for your site.</p>\n<p>This is the top level products page, it uses the <em>product group</em> page type, and it allows you to show your products checked as \'featured\' on it. It also allows you to nest <em>product group</em> pages inside it.</p>\n<p>For example, you have a product group called \'DVDs\', and inside you have more product groups like \'sci-fi\' or \'horror\'.</p>\n<p>In this example we have setup a main product group (this page), with a nested product group containing 2 example products.</p>',NULL,NULL,NULL,1,1,NULL,0,6,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
