	(48364,4302,20,0,1,0,'Page','2007-11-20 12:56:41','2009-01-14 11:18:14','drag-drop','Drag & Drop',NULL,'<h2 style=\"text-align: center;\">The pages and files that make up the site tree of a SilverStripe website can be reshuffled by<br />dragging and dropping them around. This makes re-arranging your site a fun and fast activity.</h2>\n<p style=\"text-align: center;\"><em>Just tick \"Allow drag &amp; Drop reordering\" to use the feature.</em></p>\n<p><img class=\"center\" title=\"null\" src=\"assets/Uploads/_resampled/ResizedImage358412-dragndrop-demo.PNG\" alt=\"drag n drop demo screenshot\" hspace=\"null\" vspace=\"null\" width=\"358\" height=\"412\" align=\"null\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>','Drag & Drop me',NULL,NULL,1,1,NULL,0,2,NULL,1,0,'Saved (update)',NULL,'Anyone','LoggedInUsers',1,1,102,0.9,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
