	(48447,102,49,0,1,0,'','2007-10-01 12:47:24','2009-01-21 10:42:28','about-us','About Us',NULL,'<h2 style=\"text-align: center;\">We\'ve built over 200 fantastic websites, intranets, and web applications since 2000.</h2>\n<p style=\"text-align: center;\">Our people are innovative, professional, and great to work with.</p>\n<p style=\"text-align: center;\">The technology we create is open source (we\'ll never lock you in), simple to use, and cutting edge.</p>\n<p style=\"text-align: center;\"><em>Try resizing this image in the <a href=\"http://demo.silverstripe.com/admin/\">CMS</a>! When you save the page, it is resampled.</em></p>\n<p style=\"text-align: center;\"><img class=\"center\" src=\"assets/Uploads/_resampled/ResizedImage412145-silverstripe-company-core-team-photo.jpg\" alt=\"Photo of the team at SilverStripe\" width=\"412\" height=\"145\" /></p>\n<p style=\"text-align: center;\">To find out more - and to download the SilverStripe CMS - please visit <a href=\"http://www.silverstripe.com\">silverstripe.com</a>.</p>',NULL,NULL,NULL,1,1,NULL,0,2,NULL,1,0,'Saved (update)',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers',NULL,0,0,0),
