	(48536,6626,2,0,1,0,'Page','2009-01-26 10:15:42','2009-01-26 10:20:12','knowledge-and-skills','Knowledge and Skills',NULL,'<p>\n<p  style=\"margin-bottom: 13.0pt; line-height: 33.0pt; mso-pagination: none; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"color: #3298f7; font-family: \'Lucida Grande\';\">\n<p  style=\"margin-bottom: 13.0pt; line-height: 33.0pt; mso-pagination: none; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 9.0pt; mso-bidi-font-size: 22.0pt; font-family: &quot;Lucida Grande&quot;; mso-bidi-font-family: &quot;Lucida Grande&quot;; color: #3298f7;\">Brian Calhoun</span></p>\n<p  style=\"text-align: right; line-height: 21.0pt; mso-pagination: none; mso-layout-grid-align: none; text-autospace: none;\" align=\"right\"><span style=\"font-size: 9.0pt; mso-bidi-font-size: 14.0pt; font-family: Georgia; mso-bidi-font-family: Georgia; color: #333333;\">&nbsp;</span></p>\n<p  style=\"margin-bottom: 22.0pt; line-height: 17.0pt; mso-pagination: none; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 9.0pt; mso-bidi-font-size: 15.0pt; font-family: &quot;Lucida Grande&quot;; mso-bidi-font-family: &quot;Lucida Grande&quot;; color: #666666;\">CEO</span></p>\n<p  style=\"margin-bottom: 24.0pt; line-height: 20.0pt; mso-pagination: none; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 9.0pt; mso-bidi-font-size: 14.0pt; font-family: Georgia; mso-bidi-font-family: Georgia; color: #333333;\">Brian brings over 19 years of software and web industry experience mostly in Silicon Valley and since 2004, Brian\'s been a proud Wellingtonian</span></p>\n<p  style=\"margin-bottom: 24.0pt; line-height: 20.0pt; mso-pagination: none; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 9.0pt; mso-bidi-font-size: 14.0pt; font-family: Georgia; mso-bidi-font-family: Georgia; color: #333333;\">Since his appointment as CEO in 2007, Brian has led the company by providing vision and experience to a wide range of efforts: core technology direction, technical and process infrastructure, product offerings, and <a href=\"http://silverstripe.com/agile-approach/\"><span style=\"color: #41a3f8; text-decoration: none; text-underline: none;\">Agile project management</span></a> that all combine to make SilverStripe hum. In addition, he\'s the go-to guy for all things grey-hair-corporate-related.</span></p>\n<p  style=\"margin-bottom: 24.0pt; line-height: 20.0pt; mso-pagination: none; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 9.0pt; mso-bidi-font-size: 14.0pt; font-family: Georgia; mso-bidi-font-family: Georgia; color: #333333;\">Brian has contributed to and implemented open source CMS products here in New Zealand and in the U.S. He has led web projects and architected sites for over 12 years, including government and commercial sites in New Zealand.</span></p>\n<p  style=\"margin-bottom: 24.0pt; line-height: 20.0pt; mso-pagination: none; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 9.0pt; mso-bidi-font-size: 14.0pt; font-family: Georgia; mso-bidi-font-family: Georgia; color: #333333;\">SilverStripe is excited to have Brian on board, helping to ensure SilverStripe stays true to the original vision while providing new vision and leadership as well.</span></p>\n<p  style=\"margin-bottom: 22.0pt; line-height: 17.0pt; mso-pagination: none; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 9.0pt; mso-bidi-font-size: 15.0pt; font-family: &quot;Lucida Grande&quot;; mso-bidi-font-family: &quot;Lucida Grande&quot;; color: #666666;\">Check out Brian Calhoun\'s profile <a href=\"http://www.silverstripe.org/ForumMemberProfile/show/12\"><span style=\"color: #41a3f8; text-decoration: none; text-underline: none;\">here</span></a></span></p>\n<p><span style=\"font-size: 9.0pt; mso-bidi-font-size: 15.0pt; font-family: &quot;Lucida Grande&quot;; mso-bidi-font-family: &quot;Lucida Grande&quot;; color: #666666;\">Interested in joining the team?Ã¢â‚¬¨Then check out <a href=\"http://silverstripe.com/careers/\"><span style=\"color: #41a3f8; text-decoration: none; text-underline: none;\">Careers at SilverStripe</span></a></span></p>\n<p><span style=\"font-size: 10.0pt; mso-bidi-font-size: 12.0pt;\">&nbsp;</span></p>\n</span></p>\n</p>','Knowledge and Skills',NULL,NULL,1,1,NULL,0,1,NULL,0,0,'Saved (new)',NULL,'Anyone','LoggedInUsers',0,0,6625,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
