	(48554,1302,49,0,0,0,'Page','2007-10-01 13:47:31','2009-07-23 09:50:07','subpage-demo','Subpage demo',NULL,'<h2 style=\"text-align: center;\">SilverStripe lets you structure the website in a logical, organised way by \"nesting\" pages in a hierarchy.<br /> (This is shown in a site tree as seen below in the CMS)</h2>\n<p style=\"text-align: center;\">When you build templates you choose how to lay out your menus.</p>\n<div><img class=\"center\" src=\"assets/Uploads/_resampled/ResizedImage358412-dragndrop-demo.PNG\" alt=\"Image of CMS showing site tree\" width=\"358\" height=\"412\" /></div>\n<p>&nbsp;</p>',NULL,NULL,NULL,1,1,NULL,0,1,NULL,1,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,102,0.9,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
