	(48560,4302,24,0,0,0,'Page','2007-11-20 12:56:41','2009-07-23 09:50:07','drag-drop','Drag & Drop',NULL,'<h2 style=\"text-align: center;\">The pages and files that make up the site tree of a SilverStripe website can be reshuffled by<br />dragging and dropping them around. This makes re-arranging your site a fun and fast activity.</h2>\n<p style=\"text-align: center;\"><em>Just tick \"Allow drag &amp; drop reordering\" to use the feature.</em></p>\n<p><img class=\"center\" title=\"null\" src=\"assets/Uploads/_resampled/ResizedImage358412-dragndrop-demo.PNG\" alt=\"drag n drop demo screenshot\" hspace=\"null\" vspace=\"null\" width=\"358\" height=\"412\" align=\"null\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>','Drag & Drop me',NULL,NULL,1,1,NULL,0,2,NULL,1,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,102,0.9,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
