	(48573,102,58,0,0,0,'','2007-10-01 12:47:24','2009-07-23 09:50:07','about-us','About Us',NULL,'<h2 style=\"text-align: center;\">We\'ve built over 200 fantastic websites, intranets, and web applications since 2000.</h2>\n<p style=\"text-align: center;\">Our people are innovative, professional, and great to work with.</p>\n<p style=\"text-align: center;\">The technology we create is open source (we\'ll never lock you in), simple to use, and cutting edge.</p>\n<p style=\"text-align: center;\"><em>Try resizing this image in the <a href=\"http://demo.silverstripe.com/admin/\">CMS</a>! When you save the page, it is resampled.</em></p>\n<p style=\"text-align: center;\"><img class=\"center\" src=\"assets/Uploads/_resampled/ResizedImage412145-silverstripe-company-core-team-photo.jpg\" alt=\"Photo of the team at SilverStripe\" width=\"412\" height=\"145\" /></p>\n<p style=\"text-align: center;\">To find out more - and to download the SilverStripe CMS - please visit <a href=\"http://www.silverstripe.com\">silverstripe.com</a>.</p>',NULL,NULL,NULL,1,1,NULL,0,2,NULL,1,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(48574,202,70,0,0,0,'','2007-10-01 12:47:24','2009-07-23 09:50:07','contact-us','Contact Us',NULL,'<p style=\"text-align: center;\">You can fill this page with your own content or delete it and create your own pages.</p>\n<table style=\"text-align: left;\" border=\"0\" summary=\"Listing of SilverStripe\'s contact information\">\n<tbody>\n<tr>\n<td>Phone&nbsp;</td>\n<td>+644 978 7330&nbsp;</td>\n</tr>\n<tr>\n<td>Email</td>\n<td>support at silverstripe.com&nbsp;</td>\n</tr>\n<tr>\n<td>Postal Address<br /></td>\n<td>PO BOX 11804, Wellington&nbsp;</td>\n</tr>\n<tr>\n<td class=\"center\">Physical Address<br /></td>\n<td class=\"center\">Level 5, 97-99 Courtenay Place, Wellington&nbsp;</td>\n</tr>\n</tbody>\n</table>\n<p style=\"text-align: center;\">The CMS allows you to build simple forms that email and store data:</p>\n<p style=\"text-align: left;\"><img class=\"center\" src=\"assets/Uploads/_resampled/ResizedImage600366-form-editor.png\" alt=\"Screenshot of the CMS showing the setup of the form below\" width=\"600\" height=\"366\" /></p>\n<p style=\"text-align: left;\">&nbsp;</p>\n<p style=\"text-align: center;\">The result will be:</p>',NULL,NULL,NULL,1,1,NULL,0,13,NULL,1,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
