	(48801,202,72,1,1,1,'','2007-10-01 12:47:24','2010-10-27 12:14:06','contact-us','Contact Us',NULL,'<p style=\"text-align: center;\">You can fill this page with your own content or delete it and create your own pages.</p>\n<table style=\"text-align: left;\" border=\"0\" summary=\"Listing of SilverStripe\'s contact information\"><tbody><tr><td>Phone </td>\n<td>+644 978 7330 </td>\n</tr><tr><td>Email</td>\n<td>support at silverstripe.com </td>\n</tr><tr><td>Postal Address<br/></td>\n<td>PO BOX 11804, Wellington </td>\n</tr><tr><td class=\"center\">Physical Address<br/></td>\n<td class=\"center\">Level 5, 97-99 Courtenay Place, Wellington </td>\n</tr></tbody></table><p style=\"text-align: center;\">The UserForms module allows you to build simple forms that email and store data:</p>\n<p style=\"text-align: left;\"><img class=\"center\" src=\"assets/Uploads/_resampled/resizedimage600366-form-editor.png\" alt=\"Screenshot of the CMS showing the setup of the form below\" width=\"600\" height=\"366\" title=\"\"/></p>\n<p style=\"text-align: left;\"> </p>\n<p style=\"text-align: center;\">The result will be: $UserDefinedForm</p>',NULL,NULL,NULL,1,1,NULL,0,7,NULL,0,0,'Saved (update)',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(48802,1302,52,1,1,1,'Page','2007-10-01 13:47:31','2011-01-27 08:38:27','subpage-demo','Subpage demo',NULL,'<h2 style=\"text-align: center;\">SilverStripe lets you structure the website in a logical, organised way by \"nesting\" pages in a hierarchy.<br/> (This is shown in a site tree as seen below in the CMS)</h2>\n<p style=\"text-align: center;\">When you build templates you choose how to lay out your menus.</p>\n<div style=\"width: 358px; text-align: center;\"/>\n<p><img class=\"center\" src=\"assets/Uploads/dragndrop-demo.PNG\" alt=\"Image of CMS showing site tree\" width=\"358\" height=\"412\" title=\"\"/></p>',NULL,NULL,NULL,1,1,NULL,0,1,NULL,0,0,'Saved (update)',NULL,'Anyone','LoggedInUsers',1,1,102,0.9,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(48803,4302,33,1,1,1,'Page','2007-11-20 12:56:41','2011-01-27 08:40:31','drag-drop','Drag & drop',NULL,'<h2 style=\"text-align: center;\">The pages and files that make up the site tree of a SilverStripe website can be reshuffled by<br/>dragging and dropping them around. This makes re-arranging your site a fun and fast activity.</h2>\n<p style=\"text-align: center;\"><em>Just tick \"Allow drag &amp; drop reordering\" to use the feature.</em></p>\n<p><img class=\"center\" src=\"assets/Uploads/dragndrop-demo.PNG\" alt=\"drag n drop demo screenshot\" title=\"null\" hspace=\"null\" vspace=\"null\" width=\"358\" height=\"412\" align=\"null\"/></p>\n<p> </p>\n<p> </p>','Drag & drop',NULL,NULL,1,1,NULL,0,2,NULL,0,0,'Saved (update)',NULL,'Anyone','LoggedInUsers',0,0,102,NULL,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(48804,1302,53,1,1,1,'Page','2007-10-01 13:47:31','2011-01-27 08:43:42','subpage-demo','Subpage demo',NULL,'<h2 style=\"text-align: center;\">SilverStripe lets you structure the website in a logical, organised way by \"nesting\" pages in a hierarchy.<br/> (This is shown in a site tree as seen below in the CMS)</h2>\n<p style=\"text-align: center;\">When you build templates you choose how to lay out your menus.</p>\n<p class=\"center\" style=\"text-align: left;\"><img class=\"center\" src=\"assets/Uploads/dragndrop-demo.PNG\" alt=\"Image of CMS showing site tree\" width=\"358\" height=\"412\" title=\"\"/></p>',NULL,NULL,NULL,1,1,NULL,0,1,NULL,0,0,'Saved (update)',NULL,'Anyone','LoggedInUsers',1,1,102,0.9,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
