	(48829,1302,54,1,1,1,'Page','2007-10-01 13:47:31','2012-05-25 08:22:21','subpage-demo','Subpage demo',NULL,'<h2 style=\"text-align: center;\">SilverStripe lets you structure the website in a logical, organised way by \"nesting\" pages in a hierarchy.<br/> (This is shown in a site tree as seen below in the CMS)</h2>\n<p style=\"text-align: center;\">When you build templates you choose how to lay out your menus.</p>\n<p style=\"text-align: center;\"><strong>(Sig: Replace image below)</strong></p>\n<p class=\"center\" style=\"text-align: left;\"><img class=\"center\" title=\"\" src=\"assets/Uploads/dragndrop-demo.PNG\" alt=\"Image of CMS showing site tree\" height=\"412\" width=\"358\"/></p>',NULL,NULL,NULL,1,1,NULL,0,1,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,102,0.9,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(48830,4302,34,1,1,1,'Page','2007-11-20 12:56:41','2012-05-25 08:23:26','drag-and-drop-sitemap','Drag & drop sitemap',NULL,'<h2 style=\"text-align: center;\">The pages and files that make up the site tree of a SilverStripe website can be reshuffled by<br/>dragging and dropping them around. This makes re-arranging your site a fun and fast activity<em>.</em></h2>\n<p><em>(Sig: Replace image)<br/></em></p>\n<p><img class=\"center\" title=\"null\" src=\"assets/Uploads/dragndrop-demo.PNG\" alt=\"drag n drop demo screenshot\" align=\"null\" height=\"412\" hspace=\"null\" vspace=\"null\" width=\"358\"/></p>\n<p> </p>\n<p> </p>','Drag & drop',NULL,NULL,1,1,NULL,0,2,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',0,0,102,NULL,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(48831,202,73,1,1,1,'Page','2007-10-01 12:47:24','2012-05-25 08:28:06','contact-us','Contact Us',NULL,'<p style=\"text-align: left;\">You can fill this page with your own content or delete it and create your own pages.</p>\n<table style=\"text-align: left;\" summary=\"Listing of SilverStripe\'s contact information\" border=\"0\"><tbody><tr><td>Phone </td>\n<td>+644 978 7330 </td>\n</tr><tr><td>Email</td>\n<td>support at silverstripe.com </td>\n</tr><tr><td>Postal Address</td>\n<td>PO BOX 11804, Wellington </td>\n</tr><tr><td class=\"center\">Physical Address</td>\n<td class=\"center\">Level 5, 97-99 Courtenay Place, Wellington </td>\n</tr></tbody></table>',NULL,NULL,NULL,1,1,NULL,0,7,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
