	(48850,6672,13,1,1,1,'Page','2012-05-24 17:32:21','2012-05-25 10:51:36','media-insertion','Media insertion',NULL,'<p>You can insert media from a variety of sites into your page, thanks to the magic of oEmbed! Just click the \"insert media\" button (it looks like a picture of a tree) and enter the URL of your video (youtube, vimeo), photo (flickr, or URL), or presentation (slideshare).</p>\n<p><img class=\"left\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage600327-media-inserter.png\" alt=\"media inserter demo\" height=\"327\" width=\"600\"/></p>\n<p>Example embedded of video:</p>\n<div class=\"captionImage center\" style=\"width: 600px;\">[embed width=600 height=337 class=center thumbnail=http://b.vimeocdn.com/ts/103/759/103759717_640.jpg?r]http://vimeo.com/16842606[/embed]\n<p class=\"caption\">You can also embed SlideShare presentations.</p>\n<p class=\"caption\">[embed width=425 height=355 class=left thumbnail=http://www.slideshare.net/silverstripe/silverstripe-participates-in-gsoc-2012?r]http://www.slideshare.net/silverstripe/silverstripe-participates-in-gsoc-2012[/embed]</p>\n</div>','Media insertion',NULL,NULL,1,1,NULL,0,3,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,6676,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(48851,6673,2,0,1,0,'','2012-05-24 17:33:58','2012-05-25 10:52:37','gridfieldtest','GridField Test',NULL,NULL,NULL,NULL,NULL,1,1,NULL,0,9,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,6676,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(48852,6673,3,0,1,0,'','2012-05-24 17:33:58','2012-05-25 10:52:37','gridfieldtest','GridField Test',NULL,NULL,NULL,NULL,NULL,1,1,NULL,0,4,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,6676,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(48853,6673,4,1,1,1,'','2012-05-24 17:33:58','2012-05-25 10:55:51','gridfield-demo','GridField',NULL,'<p>A \"GridField\" enables you website to contain databases of information, managed in the CMS and used to provide data to the public site. As shown below they can be configured to be editable to site visitors too.</p>',NULL,NULL,NULL,1,1,NULL,0,4,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,6676,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(48854,6678,1,0,1,0,'Page','2012-05-25 10:58:19','2012-05-25 10:58:19','new-page','New Page',NULL,NULL,NULL,NULL,NULL,1,1,NULL,0,3,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,102,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(48855,6678,2,1,1,1,'Page','2012-05-25 10:58:19','2012-05-25 11:02:55','styles','Styles',NULL,'<h1>Heading One</h1>\n<h2>Heading Two</h2>\n<h3>Heading Three</h3>\n<p>Normal text, <a href=\"[sitetree_link,id=86]\">hyperlinks</a>, <strong>bold</strong>, and <em>italics</em>.</p>\n<blockquote>\n<p>Quotes.</p>\n</blockquote>\n<p>Pages of your website should be typographically consistent. Content authors can choose from a list of styles by a designer (in a CSS file). Removing the option for content authors to chose font colours and faces produces better professionalism of the website, and makes the editing interface simpler.</p>','Styles',NULL,NULL,1,1,NULL,0,3,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,102,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(48856,86,244,1,1,1,'Page','2007-10-01 12:47:24','2012-05-25 11:03:02','home','Try the Silverstripe CMS Demo','Home','<div id=\"Thanks\">\n<p style=\"text-align: left;\">Welcome to the demo of SilverStripe 3 beta. Please browse around.</p>\n<p style=\"text-align: left;\"><a href=\"admin/\">Try out the content authoring interface</a> by logging in with \'admin\' and \'password\'.</p>\n<p style=\"text-align: left;\"><img class=\"left\" title=\"\" src=\"assets/Photos/_resampled/resizedimage600395-450552-001.jpg\" alt=\"450552-001.jpg\" width=\"600\" height=\"395\"/></p>\n</div>','Welcome to the SilverStripe Open Source CMS demo','this is my test of this website template...',NULL,1,1,NULL,0,2,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',0,0,0,NULL,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(48857,6678,3,1,1,1,'Page','2012-05-25 10:58:19','2012-05-25 11:05:16','styles','Styles',NULL,'<p>Pages of your website should be typographically consistent. Content authors can choose from a list of styles by a designer (in a CSS file). Removing the option for content authors to chose font colours and faces produces better professionalism of the website, and makes the editing interface simpler. It also means you can later change the visual apperance or theme of your website without altering your written content.</p>\n<h1>Heading One</h1>\n<h2>Heading Two</h2>\n<h3>Heading Three</h3>\n<p>Normal text, <a href=\"[sitetree_link,id=86]\">hyperlinks</a>, <strong>bold</strong>, and <em>italics</em>.</p>\n<blockquote>\n<p>Quote. Quote. Quote.</p>\n</blockquote>\n<ul><li>Bullet One</li>\n<li>Bullet Two</li>\n<li>Bullet Three</li>\n</ul>','Styles',NULL,NULL,1,1,NULL,0,3,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,102,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(48858,6678,4,1,1,1,'Page','2012-05-25 10:58:19','2012-05-25 11:10:30','styles','Styles',NULL,'<p>Pages of your website should be typographically consistent. Content authors can choose from a list of styles by a designer (in a CSS file). Removing the option for content authors to chose font colours and faces produces better professionalism of the website, and makes the editing interface simpler. It also means you can later change the visual apperance or theme of your website without altering your written content.</p>\n<h1>Heading One</h1>\n<h2>Heading Two</h2>\n<h3>Heading Three</h3>\n<p>Normal text, <a href=\"[sitetree_link,id=86]\">hyperlinks</a>, <strong>bold</strong>, and <em>italics</em>.</p>\n<blockquote>\n<p>Quote. Quote. Quote.</p>\n</blockquote>\n<p>You can insert symbols © and SilverStripe supports characters from languages across the globe. ÄÃ¨Ã­Ã¸Ã¼.</p>\n<ul><li>Bullet One</li>\n<li>Bullet Two</li>\n<li>Bullet Three</li>\n</ul>','Styles',NULL,NULL,1,1,NULL,0,3,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,102,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(48859,6674,6,1,1,1,'Page','2012-05-25 08:28:48','2012-05-25 11:19:18','responsive','Responsive',NULL,'<p>Reduce the width of your browser window to the length of this line.</p>\n<p>The menus and other elements of the page will change to be mobile friendly.</p>\n<p>Or, view this page on your favourite smartphone.</p>\n<p>That\'s called a responsive design, and this behaviour is provided by the default SilverStripe 3 theme, named Simple.</p>\n<p><img class=\"left\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage378567-iPhoneSimple.PNG\" alt=\"iPhone screenshot of Simple\" height=\"567\" width=\"378\"/></p>','Responsive',NULL,NULL,1,1,NULL,0,2,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,6676,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(48860,1302,55,1,1,1,'Page','2007-10-01 13:47:31','2012-05-25 11:28:00','subpage-demo','Subpage demo',NULL,'<h2 style=\"text-align: left;\">SilverStripe CMS lets you structure the website in a logical, organised way by \"nesting\" pages in a hierarchy.</h2>\n<p>As you alter the site tree shown below, menus through your website are updated.</p>',NULL,NULL,NULL,1,1,NULL,0,1,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,102,0.9,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(48861,1302,56,1,1,1,'Page','2007-10-01 13:47:31','2012-05-25 11:30:36','subpage-demo','Subpage demo',NULL,'<h2 style=\"text-align: left;\">SilverStripe CMS lets you structure the website in a logical, organised way by \"nesting\" pages in a hierarchy.</h2>\n<p>As you alter the site tree shown below, menus through your website are updated. Clicking on a page in the site tree enables you to edit that page.</p>\n<p><img class=\"left\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage600359-screenshot-sitetree.png\" alt=\"screenshot sitetree\" height=\"359\" width=\"600\"/></p>',NULL,NULL,NULL,1,1,NULL,0,1,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,102,0.9,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(48862,6679,1,0,1,0,'Page','2012-05-25 11:31:30','2012-05-25 11:31:30','new-page','New Page',NULL,NULL,NULL,NULL,NULL,1,1,NULL,0,4,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,102,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(48863,6679,2,1,1,1,'Page','2012-05-25 11:31:30','2012-05-25 11:34:39','easy-page-editing','Easy page editing',NULL,'<p>It\'s easy to locate a page to edit, and a rich-text editor makes content updating very easy.</p>\n<p>A site can have any number of page <em>types</em>, each with their own edtiable fields, templates, and behaviour. A developer can invent new types of fields and behaviour both in the CMS and in public-facing website. This enables both the CMS and the website to be perfectly tailored to suit requirements.</p>\n<p> </p>','Easy page editing',NULL,NULL,1,1,NULL,0,4,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,102,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(48864,6679,3,1,1,1,'Page','2012-05-25 11:31:30','2012-05-25 11:35:35','easy-page-editing','Easy page editing',NULL,'<p>It\'s easy to locate a page to edit, and a rich-text editor makes content updating very easy.</p>\n<p>A site can have any number of page <em>types</em>, each with their own editable fields, templates, and behaviour. A developer can invent new types of fields and behaviour both in the CMS and for the public-facing website. This enables both the CMS and the website to be perfectly tailored to suit requirements.</p>\n<p> </p>','Easy page editing',NULL,NULL,1,1,NULL,0,4,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,102,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(48865,6679,4,1,1,1,'Page','2012-05-25 11:31:30','2012-05-25 11:39:43','easy-page-editing','Easy page editing',NULL,'<p>It\'s easy to locate a page to edit, and a rich-text editor makes content updating very easy. Adding pages, links, images, and videos can all be done from your web browser without technical or HTML knowledge.</p>\n<p>A site can have any number of page <em>types</em>, each with their own editable fields, templates, and behaviour. A developer can invent new types of fields and behaviour both in the CMS and for the public-facing website. This enables both the CMS and the website to be perfectly tailored to suit requirements.</p>\n<p>The notion of a Draft and Published site enables you to save and preview your changes before the public see it.</p>\n<p><img class=\"left\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage600421-screenshot-3-general.png\" alt=\"screenshot 3 general\" height=\"421\" width=\"600\"/></p>\n<p> </p>','Easy page editing',NULL,NULL,1,1,NULL,0,4,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,102,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(48866,6679,5,1,1,1,'Page','2012-05-25 11:31:30','2012-05-25 11:40:46','easy-page-editing','Easy page editing',NULL,'<p>It\'s easy to locate a page to edit, and a rich-text editor makes content updating very easy. Adding pages, links, images, and videos can all be done from your web browser without technical or HTML knowledge.</p>\n<p>A site can have any number of page <em>types</em>, each with their own editable fields, templates, and behaviour. A developer can invent new types of fields and behaviour both in the CMS and for the public-facing website. This enables both the CMS and the website to be perfectly tailored to suit requirements.</p>\n<p>The notion of a Draft and Published site enables you to save and preview your changes before the public see it.</p>\n<p><img class=\"left\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage600421-screenshot-3-general.png\" alt=\"screenshot 3 general\" height=\"421\" width=\"600\"/></p>\n<p> </p>','Easy page editing',NULL,NULL,1,1,NULL,0,1,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,102,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(48867,6678,5,1,1,1,'Page','2012-05-25 10:58:19','2012-05-25 11:40:50','styles','Styles',NULL,'<p>Pages of your website should be typographically consistent. Content authors can choose from a list of styles by a designer (in a CSS file). Removing the option for content authors to chose font colours and faces produces better professionalism of the website, and makes the editing interface simpler. It also means you can later change the visual apperance or theme of your website without altering your written content.</p>\n<h1>Heading One</h1>\n<h2>Heading Two</h2>\n<h3>Heading Three</h3>\n<p>Normal text, <a href=\"[sitetree_link,id=86]\">hyperlinks</a>, <strong>bold</strong>, and <em>italics</em>.</p>\n<blockquote>\n<p>Quote. Quote. Quote.</p>\n</blockquote>\n<p>You can insert symbols © and SilverStripe supports characters from languages across the globe. ÄÃ¨Ã­Ã¸Ã¼.</p>\n<ul><li>Bullet One</li>\n<li>Bullet Two</li>\n<li>Bullet Three</li>\n</ul>','Styles',NULL,NULL,1,1,NULL,0,2,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,102,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(48868,4302,35,0,1,0,'Page','2007-11-20 12:56:41','2012-05-25 11:43:43','drag-and-drop-sitemap','Drag & drop sitemap',NULL,'<h2 style=\"text-align: center;\">The pages and files that make up the site tree of a SilverStripe website can be reshuffled by<br/>dragging and dropping them around. This makes re-arranging your site a fun and fast activity<em>.</em></h2>\n<p><em>(Sig: Replace image)<br/></em></p>\n<p><img class=\"center\" title=\"null\" src=\"assets/Uploads/dragndrop-demo.PNG\" alt=\"drag n drop demo screenshot\" align=\"null\" height=\"412\" hspace=\"null\" vspace=\"null\" width=\"358\"/></p>\n<p> </p>\n<p> </p>','Drag & drop',NULL,NULL,1,1,NULL,0,2,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',0,0,102,NULL,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(48869,6680,1,0,1,0,'Page','2012-05-25 11:46:39','2012-05-25 11:46:39','new-page','New Page',NULL,NULL,NULL,NULL,NULL,1,1,NULL,0,5,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,102,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(48870,4302,36,1,1,1,'Page','2007-11-20 12:56:41','2012-05-25 11:46:50','drag-and-drop-sitemap','Drag & drop sitemap',NULL,'<h2 style=\"text-align: left;\">The pages and files that make up the site tree of a SilverStripe website can be reshuffled by dragging and dropping them around.</h2>\n<p style=\"text-align: left;\">This makes re-arranging your site a fun and fast activity<em>.</em></p>\n<p style=\"text-align: left;\"><em><img class=\"left\" title=\"\" src=\"assets/Uploads/screenshot-dragdropsitemap.png\" alt=\"screenshot dragdrop sitemap\" height=\"298\" width=\"256\"/></em></p>\n<p><em> </em></p>\n<p> </p>\n<p> </p>\n<p> </p>','Drag & drop',NULL,NULL,1,1,NULL,0,2,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',0,0,102,NULL,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(48871,6676,5,1,1,1,'Page','2012-05-25 10:09:09','2012-05-25 11:47:57','new-features','New Features',NULL,'<p>SilverStripe 3 has a number of new site editing features. The main thing you\'ll notice a entirely refreshed and revamped user interface.</p>\n<p><img class=\"leftAlone\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage750552-Screen-Shot-2012-05-25-at-10.23.44-AM.png\" alt=\"Screen Shot of SS3 Interface\" height=\"552\" width=\"750\"/></p>','New Features',NULL,NULL,1,1,NULL,0,3,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,0,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(48872,6680,2,1,1,1,'Page','2012-05-25 11:46:39','2012-05-25 11:48:40','test-page-1','Test page 1',NULL,'<p>ajksndiajifubap</p>\n<p> </p>\n<div class=\"captionImage left\" style=\"width: 480px;\">[embed width=480 height=270 class=left thumbnail=http://i3.ytimg.com/vi/r08fPLpvXwg/hqdefault.jpg?r=89900]http://www.youtube.com/watch?v=r08fPLpvXwg&amp;feature=bf_next&amp;list=FLZNVoKAKjs6qKv_wGliftlw[/embed]\n<p class=\"caption\">NEW MUSIC</p>\n</div>','Test page 1',NULL,NULL,1,1,NULL,0,5,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,102,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(48873,102,77,1,1,1,'Page','2007-10-01 12:47:24','2012-05-25 11:53:26','about','About',NULL,'<h2 style=\"text-align: left;\">SilverStripe is a friendly and flexible open source CMS.</h2>\n<p>It\'s designed to be super easy to update content, and to let designers and developers build rich, amazing, websites.</p>\n<p>It\'s been downloaded about 500,000 times and powers websites for government agencies, corporations, non profits, and a large number of much smaller websites.</p>\n<p>It\'s created by SilverStripe Ltd, pictured below, together with a vibrant open source community.</p>\n<p><em>(Try resizing this image in the <a href=\"http://demo.silverstripe.com/admin/\">CMS</a>! When you save the page, it is resampled.)</em></p>\n<p style=\"text-align: left;\"><em><img class=\"center\" title=\"\" src=\"assets/Uploads/New-Team-Photo.jpg\" alt=\"\"/><br/></em></p>\n<p style=\"text-align: left;\"> </p>\n<p style=\"text-align: left;\">To find out more - and to download the SilverStripe CMS - please visit <a href=\"http://www.silverstripe.org\">silverstripe.org</a>.</p>',NULL,NULL,NULL,1,1,NULL,0,2,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(48874,1302,57,0,1,0,'Page','2007-10-01 13:47:31','2012-05-25 12:02:19','subpage-demo','Subpage demo',NULL,'<h2 style=\"text-align: left;\">SilverStripe CMS lets you structure the website in a logical, organised way by \"nesting\" pages in a hierarchy.</h2>\n<p>As you alter the site tree shown below, menus through your website are updated. Clicking on a page in the site tree enables you to edit that page.</p>\n<p><img class=\"left\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage600359-screenshot-sitetree.png\" alt=\"screenshot sitetree\" height=\"359\" width=\"600\"/></p>',NULL,NULL,NULL,1,1,NULL,0,2,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,102,0.9,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(48875,1302,58,1,1,1,'Page','2007-10-01 13:47:31','2012-05-25 12:02:58','subpage-demo','Subpage demo',NULL,'<h2 style=\"text-align: left;\">SilverStripe CMS lets you structure the website in a logical, organised way by \"nesting\" pages in a hierarchy.</h2>\n<p>As you alter the site tree shown below, menus and lists throughout the website are updated. Clicking on a page in the site tree enables you to edit that page.</p>\n<p><img class=\"left\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage600359-screenshot-sitetree.png\" alt=\"screenshot sitetree\" height=\"359\" width=\"600\"/></p>',NULL,NULL,NULL,1,1,NULL,0,2,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,102,0.9,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
