	(48879,6680,3,1,1,1,'Page','2012-05-25 11:46:39','2012-05-25 13:48:19','under-the-hood','Under the hood',NULL,'<p>Behind the clean CMS and website presentation sits <a href=\"http://www.silverstripe.org/framework-introduction/\">SilverStripe Framework</a>. Website developers use the framework to write code to create templates, logic, and tailor how the CMS works. Developers get the power and flexibility of (object oriented) code, designers get the freedom of HTML and CSS, and content authors get the simplicity of a tailored CMS.</p>\n<p><img class=\"leftAlone\" title=\"\" src=\"assets/Uploads/silverstripe-php-code-sample.png\" alt=\"silverstripe php code sample\" height=\"162\" width=\"298\"/></p>','Test page 1',NULL,NULL,1,1,NULL,0,5,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,102,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
