	(48902,1302,62,1,1,1,'Page','2007-10-01 13:47:31','2012-06-28 14:19:50','the-site-tree','The site tree',NULL,'<h2 style=\"text-align: left;\">SilverStripe CMS lets you structure the website in a logical, organised way by \"nesting\" pages in a hierarchy.</h2>\n<p>As you alter the site tree shown below, menus and lists throughout the website are updated. Clicking on a page in the site tree lets you edit that page.</p>\n<p><img class=\"left\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage600359-screenshot-sitetree.png\" alt=\"screenshot sitetree\" height=\"359\" width=\"600\"/></p>',NULL,NULL,NULL,1,1,NULL,0,3,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,102,0.9,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(48903,6673,10,0,1,0,'','2012-05-24 17:33:58','2012-06-28 15:30:21','gridfieldtest','GridField',NULL,'<p>A <em>GridField</em> enables you to manage databases and lists of information stored on your website. It contains a variety of filtering, searching, adding, editing, importing, and exporting capabilities. A GridField can also manage relationships, such as </p>\n<ul><li>The GridField can be edited in its own section, replacing what was previouslly called ModelAdmin.</li>\n<li>A GridField can be added to any page.</li>\n<li>A GridField can be displayed and optinally editable on your website.</li>\n</ul>',NULL,NULL,NULL,1,1,NULL,0,4,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,0,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(48904,6673,11,1,1,1,'','2012-05-24 17:33:58','2012-06-28 15:34:34','gridfieldtest','GridField',NULL,'<p>A <em>GridField</em> enables you to manage databases and lists of information stored on your website. It provides filtering, searching, adding, editing, importing, and exporting capabilities. A GridField can also manage relationships, such as letting you create a list of companies, and a list of people, and then connecting which people work for which companies.</p>\n<ul><li>A GridField can be added to a page. </li>\n<li>A GridField can be made into a full CMS section, through the use of ModelAdmin.</li>\n<li>A GridField can be displayed as a web page, and can even be made editable publicly..</li>\n</ul>',NULL,NULL,NULL,1,1,NULL,0,4,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,0,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(48905,6673,12,0,1,0,'','2012-05-24 17:33:58','2012-06-28 15:34:49','gridfieldtest','GridField',NULL,'<p>A <em>GridField</em> enables you to manage databases and lists of information stored on your website. It provides filtering, searching, adding, editing, importing, and exporting capabilities. A GridField can also manage relationships, such as letting you create a list of companies, and a list of people, and then connecting which people work for which companies.</p>\n<ul><li>A GridField can be added to a page. </li>\n<li>A GridField can be made into a full CMS section, through the use of ModelAdmin.</li>\n<li>A GridField can be displayed as a web page, and can even be made editable publicly..</li>\n</ul>',NULL,NULL,NULL,1,1,NULL,0,4,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,6676,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
