	(48907,6673,14,1,1,1,'','2012-05-24 17:33:58','2012-06-28 15:37:48','gridfieldtest','GridField',NULL,'<p>A <em>GridField</em> enables you to manage databases and lists of information stored on your website. It provides filtering, searching, adding, editing, importing, and exporting capabilities. A GridField can also manage relationships, such as letting you create a list of companies, and a list of people, and then connecting which people work for which companies.</p>\n<ul><li>A GridField can be added to a page. </li>\n<li>A GridField can be made into a full CMS section, through the use of ModelAdmin.</li>\n<li>A GridField can be displayed as a web page, and can even be made editable publicly</li>\n</ul><p>SilverStripe CMS also uses GridField for Listview, Files, and Security features, thereby making the system consistent and easier to learn.</p>',NULL,NULL,NULL,1,1,NULL,0,5,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,6676,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
