	(48909,6673,15,1,1,1,'','2012-05-24 17:33:58','2012-06-28 15:39:56','gridfieldtest','GridField',NULL,'<p>A <em>GridField</em> enables you to manage databases and lists of information stored on your website. It provides filtering, searching, adding, editing, importing, and exporting capabilities. A GridField can also manage relationships, such as letting you create a list of companies, and a list of people, and then connecting which people work for which companies.</p>\n<ul><li>A GridField can be added to a page. </li>\n<li>A GridField can be made into a full CMS section, through the use of ModelAdmin.</li>\n<li>A GridField can be displayed as a web page, and can even be made editable publicly</li>\n</ul><p>SilverStripe CMS also uses GridField for <a href=\"[sitetree_link,id=6682]\">Listview</a>, Files, and Security features, resulting in a consistent and user friendly interface.</p>',NULL,NULL,NULL,1,1,NULL,0,5,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,6676,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(48910,6673,16,1,1,1,'','2012-05-24 17:33:58','2012-06-28 15:46:48','gridfieldtest','GridField',NULL,'<p>A <em>GridField</em> enables you to manage databases and lists of information stored on your website. It provides filtering, searching, adding, editing, importing, and exporting capabilities. A GridField can also manage relationships, such as letting you create a list of companies, and a list of people, and then connecting which people work for which companies.</p>\n<ul><li>A GridField can be added to a page. (E.g. to manage a list of image or text items relating to a particular page.) </li>\n<li>A GridField can be made into a full CMS section, through the use of ModelAdmin. (E.g. to manage a list of items that relate to the website as a whole.)</li>\n<li>A GridField can be displayed as a web page, and can even be made editable publicly</li>\n</ul><p>SilverStripe CMS also uses GridField for <a href=\"[sitetree_link,id=6682]\">Listview</a>, Files, and Security features, resulting in a consistent and user friendly interface.</p>',NULL,NULL,NULL,1,1,NULL,0,5,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,6676,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
