	(48919,86,248,1,1,1,'Page','2007-10-01 12:47:24','2012-06-29 08:30:25','home','Try the Silverstripe CMS Demo','Home','<div id=\"Thanks\">\n<p style=\"text-align: left;\">Welcome to the demo of SilverStripe 3. Please browse around.</p>\n<p style=\"text-align: left;\"><a href=\"admin/\">Try out the content authoring interface</a> by logging in with \'admin\' and \'password\'.</p>\n<p style=\"text-align: left;\">[embed width=600 height=337 class=left thumbnail=http://b.vimeocdn.com/ts/312/000/312000748_1280.jpg?r=97907]https://vimeo.com/44848958[/embed]</p>\n</div>','Welcome to the SilverStripe Open Source CMS demo','this is my test of this website template...',NULL,1,1,NULL,0,1,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',0,0,0,NULL,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(48920,6674,7,1,1,1,'Page','2012-05-25 08:28:48','2012-06-29 08:34:02','responsive','Responsive',NULL,'<p>Reduce the width of your browser window to the length of this line.</p>\n<p>The menus and other elements of the page will change to be mobile friendly.</p>\n<p>Or, view this page on your favourite smartphone.</p>\n<p>That\'s called a responsive design, a technique made possible using HTML5. This behaviour is provided by the default SilverStripe 3 theme, named Simple.</p>\n<p><img class=\"left\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage378567-iPhoneSimple.PNG\" alt=\"iPhone screenshot of Simple\" width=\"378\" height=\"567\"/></p>','Responsive',NULL,NULL,1,1,NULL,0,1,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,6676,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(48921,6676,6,1,1,1,'Page','2012-05-25 10:09:09','2012-06-29 08:36:46','new-features','New Features',NULL,'<p>SilverStripe 3 has a number of new site editing features. The main thing you\'ll notice a entirely refreshed and revamped user interface. Developers will appreciate it is built on HTML and jQuery, but content authors will just love that they can do their more quickly, and in a beautiful user interface. </p>\n<p><img class=\"leftAlone\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage750552-Screen-Shot-2012-05-25-at-10.23.44-AM.png\" alt=\"Screen Shot of SS3 Interface\" width=\"750\" height=\"552\"/></p>','New Features',NULL,NULL,1,1,NULL,0,4,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,0,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
