	(48925,6673,17,1,1,1,'','2012-05-24 17:33:58','2012-06-29 08:41:16','gridfieldtest','GridField',NULL,'<p>A <em>GridField</em> enables you to manage databases and lists of information stored on your website. It provides filtering, searching, adding, editing, importing, and exporting capabilities. A GridField can also manage relationships, such as letting you create a list of companies, and a list of people, and then connecting which people work for which companies.</p>\n<ul><li>A GridField can be added to a page. (E.g. to manage a list of image or text items relating to a particular page.) </li>\n<li>A GridField can be made into a full CMS section, through the use of ModelAdmin. (E.g. to manage a list of items that relate to the website as a whole.)</li>\n<li>A GridField can be displayed as a web page, and can even be made editable publicly as shown below.</li>\n</ul><p>SilverStripe CMS also uses GridField for <a href=\"[sitetree_link,id=6682]\">Listview</a>, Files, and Security features, resulting in a consistent and user friendly interface.</p>',NULL,NULL,NULL,1,1,NULL,0,5,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,6676,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
	(48926,6680,5,1,1,1,'Page','2012-05-25 11:46:39','2012-06-29 08:41:36','under-the-hood','Under the hood',NULL,'<p>Behind the clean CMS and website presentation sits <a href=\"http://www.silverstripe.org/framework-introduction/\">SilverStripe Framework</a>. Website developers use the framework to write code to create templates, logic, and tailor how the CMS works. Developers get the power and flexibility of (object oriented PHP 5.3+) code, designers get the freedom of HTML5 and CSS, and content authors get the simplicity of a tailored CMS.</p>\n<p><img class=\"leftAlone\" title=\"\" src=\"assets/Uploads/silverstripe-php-code-sample.png\" alt=\"silverstripe php code sample\" width=\"298\" height=\"162\"/></p>',NULL,NULL,NULL,1,1,NULL,0,6,NULL,0,0,NULL,NULL,'Anyone','LoggedInUsers',0,0,102,NULL,NULL,NULL,'Inherit','Inherit',NULL,0,0,0),
