	(49469,102,78,1,1,1,'Page','2007-10-01 12:47:24','2012-06-29 13:52:24','about','About',NULL,'<h2 style=\"text-align: left;\">SilverStripe is a friendly and flexible open source CMS.</h2>\n<p>It\'s designed to be super easy to update content, and to let designers and developers build rich, amazing, websites.</p>\n<p>It\'s been downloaded about 500,000 times and powers websites for government agencies, corporations, non profits, and a large number of much smaller websites.</p>\n<p>It\'s created by SilverStripe Ltd, pictured below, together with a vibrant open source community.</p>\n<p><em>(Try resizing this image in the <a href=\"http://demo.silverstripe.com/admin/\">CMS</a>! When you save the page, it is resampled.)</em></p>\n<p style=\"text-align: left;\"><em><img class=\"left\" title=\"\" src=\"assets/Uploads/_resampled/resizedimage500131-New-Team-Photo.jpg\" alt=\"New-Team-Photo.jpg\" width=\"500\" height=\"131\"/><br/></em></p>\n<p style=\"text-align: left;\"> </p>\n<p style=\"text-align: left;\">To find out more - and to download the SilverStripe CMS - please visit <a href=\"http://www.silverstripe.org\">silverstripe.org</a>.</p>',NULL,NULL,NULL,1,1,NULL,0,2,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',1,1,0,1,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
	(49470,86,251,1,1,1,'Page','2007-10-01 12:47:24','2012-06-29 13:53:37','home','Try the Silverstripe CMS Demo','Home','<div id=\"Thanks\">\n<p style=\"text-align: left;\">Welcome to the public demo of SilverStripe 3. Please browse around.</p>\n<p style=\"text-align: left;\"><a href=\"admin/\">Try out the content authoring interface</a> by logging in with \'admin\' and \'password\'.</p>\n<p style=\"text-align: left;\"> </p>\n<p style=\"text-align: left;\">[embed width=600 height=337 class=left thumbnail=http://b.vimeocdn.com/ts/312/000/312000748_1280.jpg?r]https://vimeo.com/44848958[/embed]</p>\n</div>','Welcome to the SilverStripe Open Source CMS demo','this is my test of this website template...','silverstripe 3, demo, cms, html5, open source content management system, php',1,1,NULL,0,1,NULL,0,0,'Published',NULL,'Anyone','LoggedInUsers',0,0,0,NULL,NULL,NULL,'Anyone','LoggedInUsers','en_US',0,0,0),
